INSERT INTO `lite_products` (`id`, `code`, `name`, `purpose`, `short_description`, `description`, `url`, `date`, `active`, `position`, `brand_id`, `item_group`, `modification_field_name`, `item_field_name`) VALUES
(1, NULL, 'MS 170', NULL, NULL, '&lt;p&gt;Malkų pjovimo pjūklas pradedantiesiems. Kombinuota svirtis užtikrina paprastą priežiūrą, taupesnis &amp;bdquo;2-MIX&amp;ldquo; variklis.&lt;/p&gt;', 'ms-170', '2021-01-06 12:51:33', 1, 1, 318, 2, NULL, NULL),
(2, NULL, 'MS 180', NULL, NULL, 'Modernus pjūklas aplinkos priežiūrai. Šoninis grandinės įtempimas užtikrina saugų ir paprastą grandinės įtempimą, ilgalaikė oro filtravimo sistema apsaugo nuo pirmalaikio oro filtro užsiteršimo, taupesnis „2-MIX“ variklis.', 'MS 180', '2021-01-06 12:51:33', 1, 2, 318, 2, NULL, NULL),
(3, NULL, 'MS 181', NULL, NULL, 'Tokios pat konstrukcijoskaip ir MS 171, bet daug našesnis. Puikiai tinka pjauti malkas.35 cm modelis tinka ir nedidelių medelių kirtimui. Metaliniai atraminiai dantukai lengvai ir tiksliai nukreipia pjūklą į pjūvį.', 'MS 180', '2021-01-06 12:51:33', 1, 3, 318, 2, NULL, NULL),
(4, NULL, 'MS 211', NULL, NULL, 'Tinka malkoms pjaustyti. Šoninis grandinės įtempimas, taupesnis „2-MIX“ variklis, perjungimas tarp vasaros ir žiemos režimų optimaliam darbui visomis sąlygomis.', 'MS 211', '2021-01-06 12:51:33', 1, 4, 318, 2, NULL, NULL),
(5, NULL, 'MS 231', NULL, NULL, 'MS 231 grandininis pjūklas idealiai tinka privatiems vartotojams ar ūkininkams mažų medžių kirtimui, malkų pjovimui ir kraštovaizdžio priežiūrai. Su pirmąja mažo profilio &quot;Picco Duro&quot; pjūklo grandine su karbido pjautuvais, pjaustymo dantukai lieka aštrūs iki keturių kartų ilgiau nei standartinių pjūklo grandinių. 70% sumažintas išmetamųjų teršalų kiekis ir degalų sąnaudos yra iki 20% mažesnės, palyginus su STIHL 2-taktų varikliu tos pačios galios, tačiau be 2-MIX technologijos.', 'MS 231', '2021-01-06 12:51:33', 1, 5, 318, 2, NULL, NULL),
(6, NULL, 'MS 251', NULL, NULL, 'Tinka malkų pjovimui miške. Šoninis grandinės įtempimas, tvirta ir ilgalaikė .325 colių pjovimo įranga, pjauti storesnius medžius galima pasirinkti 40 cm pjovimo juostą, taupesnis „2-MIX“ variklis.', 'MS 231', '2021-01-06 12:51:33', 1, 6, 318, 2, NULL, NULL),
(7, NULL, 'MS 271', NULL, NULL, 'Malkoms pjauti. Taupesnis „2-MIX“ variklis, ilgalaikė oro filtro sistema užtikrina ilgesnį filtro naudojimą, be įrankių atidaromas bako dangtelis paprastam ir saugiam degalų įpylimui, variklio gaubtą sudaro viena dalis, todėl galima greičiau atlikti techninę priežiūrą.', 'MS 271', '2021-01-06 12:51:33', 1, 7, 318, 2, NULL, NULL),
(8, NULL, 'MS 291', NULL, NULL, 'Puikiai tinka malkoms pjauti. Taupesnis „2-MIX“ variklis, ilgalaikė oro filtro sistema užtikrina ilgesnį filtro naudojimą, be įrankių atidaromas bako dangtelis paprastam ir saugiam degalų įpylimui, .325 1,6&quot; Rapid Micro pjovimo grandinė, užtikrinanti gerą darbo našumą.', 'MS 291', '2021-01-06 12:51:34', 1, 8, 318, 2, NULL, NULL),
(9, NULL, 'MS 311', NULL, NULL, 'Medžių, skirtų malkoms pjovimui vidutinio brandumo miške. Ilgalaikė oro filtravimo sistema garantuoja labai ilgą filtro naudojimo laiką, taupesnis „2-MIX“ variklis, dekompresinis vožtuvas užtikrina pjūklo\nužvedimą be pastangų.', 'MS 311', '2021-01-06 12:51:34', 1, 9, 318, 2, NULL, NULL),
(10, NULL, 'MS 391', NULL, NULL, 'Puikiai tinka medžių, skirtų malkoms, pjovimui ir statybos darbams iš medžio. Ilgalaikė oro filtravimo sistema garantuoja labai ilgą filtro naudojimo laiką, taupesnis „2-MIX“ variklis, dekompresinis vožtuvas užtikrina pjūklo užvedimą be pastangų.', 'MS 391', '2021-01-06 12:51:34', 1, 10, 318, 2, NULL, NULL),
(11, NULL, 'MS 151 C-E', NULL, NULL, 'Labai lengvas STIHL grandininis pjūklas malkoms pjaustyti, medžių priežiūros ir paprasčiausiems miško retinimo darbams. Ergonomiškas ir nevarginantis dirbant. Itin tausojantis jėgas pjūklo užvedimas dėka rankinio degalų siurblio ir STIHL „ErgoStart“. Lengvai valdoma 1/4 colio „PM3“ pjovimo grandinė labai dailiam pjūviui. Naujasis „2-MIX“ variklis, skirtas didesnei pjovimo galiai.', 'MS 151 C-E', '2021-01-06 12:51:34', 1, 11, 318, 2, NULL, NULL),
(12, NULL, 'MS 241 C-M', NULL, NULL, 'Puikiai tinka plonos medienos pjovimui, kai didesnė variklio galia ir mažesnis svoris. Standartinis modelis su „M‑Tronic” sistema, ilgalaikė oro filtravimo sistema su HD2 filtru, užtikrinančiu ilgesnius valymo intervalus,užsifiksuojanti veržlė ant grandinės žvaigždutės dangtelio, taupesnis „2-MIX“ variklis, 3/8 colių PS pjovimo grandinė, užtikrinanti itin didelį pjovimo našumą.', 'MS 241 C-M', '2021-01-06 12:51:34', 1, 12, 318, 2, NULL, NULL),
(13, NULL, 'MS 201 C-M', NULL, NULL, 'Galingiausias STIHL grandininis pjūklas su specialiai priderinta antivibracine sistema, tiksliam pjovimui ir skaptavimui. Standartinis modelis su „M-Tronic“, taupesnis „2-MIX“ variklis, STIHL „ElastoStart“ paprastesniam grandininio pjūklo užvedimui, su STIHL „Carving“ juosta, 1/4 colių RMS pjovimo grandine tiksliam ir saugiam darbui.', 'MS 201 C-M', '2021-01-06 12:51:34', 1, 13, 318, 2, NULL, NULL),
(14, NULL, 'MS 261', NULL, NULL, 'Labai lengvas, patogus ir galingas motorinis pjūklas profesionalams. Lyginant su ankstesniu modeliu, šis grandininis pjūklas pasižymi geresniu sukimo momentu ir traukos jėga. Į serijinę komplektaciją įeina: lengvai valomas HD2 filtras, alyvos kiekį reguliuojantis siurblys, amortizatorius iš nerūdijančio legiruoto plieno, nuo pametimo apsaugota veržlė ant varančiosios žvaigždutės dangčio ir vientisas viršutinis gaubtas su trimis greito fiksavimo varžtais. Su STIHL &quot;2-MIX&quot; varikliu iki 20 % mažesnės degalų sąnaudos ir iki 50 % mažiau išmetamųjų dujų, palyginti su tokios pačios galios STIHL dvitakčiais varikliais be &quot;2-MIX&quot; technologijos.', 'MS 261', '2021-01-06 12:51:34', 1, 14, 318, 2, NULL, NULL),
(15, NULL, 'MS 362', NULL, NULL, 'Modernus motorinis pjūklas su „2-MIX“ varikliu, skirtas degalų sąnaudoms iki 20 % sumažinti ir išmesti iki 50 % mažiau išmetamųjų dujų, palyginti su tradiciniais STIHL dvitakčiais varikliais be „2-MIX“ technologijos. Kita įranga: ilgalaikė oro filtravimo sistema su pirminiu nusodintuvu, profesionali STIHL antivibracinė sistema mažam vibracijos lygiui užtikrinti ir optimalus valdymas bei reguliuojamas alyvos siurblys. Labai efektyvus dirbant su vidutinio storio medžiais.', 'MS 261', '2021-01-06 12:51:34', 1, 15, 318, 2, NULL, NULL),
(16, NULL, 'MS 462', NULL, NULL, 'Lengviausi, itin galingi pjūklai, kurių tūrio klasė 70 cm3. Itin manevringi, puikaus pagreičio. Skirti kirsti, genėti šakas vidutinio brandumo ir brandžiuose miškuose. Puikiai filtruojantis HD2 filtras. Užsifiksuojančios veržlės ant grandinės žvaigždutės dangtelio supaprastina pjovimo grandinės keitimą, be įrankių užsukami bakų dangteliai, paprastam ir saugiam eksploatacinių medžiagų įpylimui, taupesnis „2-MIX“ variklis. Ypatinga STIHL MS 462 savybė yra itin didelis pagreitis, kada pjovimo grandinė nuo 0 iki 100 km/h greitį pasiekia tik per 0,3 sekundės.', 'MS 261', '2021-01-06 12:51:34', 1, 16, 318, 2, NULL, NULL),
(17, NULL, 'MS 661', NULL, NULL, 'Galingas pjūklas, skirtas sunkiausiems darbams miškininkystės sektoriuje. Alyvos kiekį reguliuojantis našus alyvos siurblys, naujas labai gerai filtruojantis HD2 oro filtras, neteršiantis aplinkos ir taupusis 2 - MIX variklis.', 'MS 261', '2021-01-06 12:51:34', 1, 17, 318, 2, NULL, NULL),
(18, NULL, 'MS 500i', NULL, NULL, 'Naujoviškas STIHL MS 500i pjūklas – tai pirmasis pasaulyje pjūklas, kuriam būdinga elektroniškai valdoma kuro įpurškimo sistema. Šis pjūklas yra dinamiškas, itin našus jo variklis įsibėgėja labai greitai. Šitas įrankis, turintis ypač sėkmingą bei lengvą konstrukciją, pasiekia įspūdingai žemą galios ir svorio santykį, jis sudaro 1,24 kg/W. STIHL MS 500i aukšto sukimo momento pjūklas itin tinka dideliems medžiams profesionaliai kirsti. Dirbant su MS 500i, galima maksimaliai mėgautis valdymu, nes šis pjūklas yra itin našus. Jam būdinga paprasta paleidimo tvarka, be to, šį įrankį lengva naudoti bet kokiomis sąlygomis. Jutikliu matuojama kuro kokybė užtikrina, kad mišinys būtų parinktas, atsižvelgiant į deguonies kiekį ore. Šį pjūklą, kaip ir MS 462, lengva valdyti, be to, nauji atraminiai dygliai ir žvaigždutės dangtelis leidžia priglausti jį arti medžio kamieno.', 'MS 500i', '2021-01-06 12:51:35', 1, 18, 318, 2, NULL, NULL),
(19, NULL, 'MS 150 TC-E', NULL, NULL, 'Lengviausi STIHL medžių priežiūros pjūklai b. Rankinis degalų siurblys ir STIHL „ErgoStart“ garantuoja paprastą užvedimą. Standartiniai modeliai su 1/4 colių pjovimo grandine švariam pjūviui.', 'MS 150 TC-E', '2021-01-06 12:51:35', 1, 19, 318, 2, NULL, NULL),
(20, NULL, 'MS 201 TC-M', NULL, NULL, 'Galingiausias STIHL medžių priežiūros pjūklas. Standartinis modelis su „M-Tronic“ sistema, kuri skirta optimaliam variklio našumui pasiekti nuo užvedimo pradžios, taupesnis „2-MIX“ variklis, nuo pametimo apsaugota veržlė ant varančiosios žvaigždutės dangtelio, pjūklo svorį mažinanti lengvos konstrukcijos pjovimo juosta.', 'MS 201 TC-M', '2021-01-06 12:51:35', 1, 20, 318, 2, NULL, NULL),
(21, NULL, 'MS 194 T', NULL, NULL, 'Įvairiapusiai STIHL medžių priežiūros pjūklai. Įvairiems darbams tokiems, kaip vainikų priežiūra, negyvos medienos šalinimas arba kamienų ir krūmų ūglių šalinimas. Su 3/8&quot; colio „P“ pjovimo grandine švariam pjūviui. Naujasis „2-MIX“ variklis didesnei pjovimo galiai.', 'MS 194 T', '2021-01-06 12:51:35', 1, 21, 318, 2, NULL, NULL),
(22, NULL, 'MS 462 C-M R', NULL, NULL, 'Galingas 4.4kW pjūklas su 2-MIX variklius. Puikiai tinka ugniagesių, techninės pagalbos tarnybų darbams su ypač atspariomis pjovimui medžiagomis. Lengvai reguliuojamas pjovimo gylis. Didelė užvedimo rankena. Speciali Rapid Duro R pjovimo grandinė, pagaminta iš smūgiams atsparių kietmetalio plokštelių. STIHL M-Tronic su tikslaus degalų kiekio apskaičiavimo funkcija užtikrina optimalų variklio našumą ir lengvą paleidimą bet kuriuo metu. Našus, aukštos kokybės alyvos siurblys – nuolatiniam grandinės tepimui, lengvai valomas HD2 filtras, be įrankių užsukami bakų dangteliai, paprastam ir saugiam eksploatacinių medžiagų įpylimui.', 'MS 462 C-M R', '2021-01-06 12:51:35', 1, 22, 318, 2, NULL, NULL),
(23, NULL, 'MSA 120 C-BQ', NULL, NULL, 'Ypač lengvas akumuliatorinis  pjūklas sodo ir sklypo priežiūrai bei gulinčios medienos pjovimui. Su STIHL greituoju grandinės įtempimu ir grandinės stabdžiu QuickStop Super. Pjovimo grandinė 1/4 &quot;-PM3 skirta  puikiam pjūviui ir aukštam pjovimo našumui. Tylus, nereikalinga klausos apsauga.', 'MSA 120 C-BQ', '2021-01-06 12:51:35', 1, 23, 318, 2, NULL, NULL),
(24, NULL, 'MSA 140 C-BQ', NULL, NULL, 'Lengvi akumuliatoriniai grandininiai pjūklai, skirti sklypo priežiūrai\nir paprastiems meistravimo darbams. 25 % daugiau pjovimo galios lyginant su MSA 120 C-BQ. Paminkštinta rankena, greitas\nir patogus grandinės keitimas dėka STIHL greito grandinės įtempimo, grandinės stabdys „QuickStop Super“, alyvos bakelis su skaidriu langeliu, didelė pjovimo galia dėka 1/4 colio PM3 pjovimo grandinės, svoris 2,6 kg.', 'MSA 140 C-BQ', '2021-01-06 12:51:35', 1, 24, 318, 2, NULL, NULL),
(25, NULL, 'MSA 160 C-BQ', NULL, NULL, 'Akumuliatoriniai motoriniai pjūklai, skirti darbui vietose, kuriose negalima kelti triukšmo, klausos apsauga nereikalinga. STIHL greitasis grandinės įtempimas, &quot;QuickStop Super&quot; grandinės stabdys, be įrankių uždaromas degalų bako dangtelis, su 1/4 colių PM3 pjovimo grandine puikiam ir galingam pjūviui, svoris 3,2 kg.', 'MSA 160 C-BQ', '2021-01-06 12:51:35', 1, 25, 318, 2, NULL, NULL),
(26, NULL, 'MSA 161 T', NULL, NULL, 'Lengvas profesionalus akumuliatorinis medžių priežiūros pjūklas, skirtas naudoti vietose, kuriose negalima kelti triukšmo. 1/4 colio „PM3“ pjovimo grandinė švariam pjūviui ir dideliam pjovimo našumui, optimizuota valdymo koncepcija, užsifiksuojančios veržlės ant varančiosios žvaigždutės dangtelio, svoris 2,1 kg.', 'MSA 161 T', '2021-01-06 12:51:35', 1, 26, 318, 2, NULL, NULL),
(27, NULL, 'MSA 200 C-BQ', NULL, NULL, 'Didesnės galios akumuliatoriniai grandininiai pjūklai, skirti darbui vietose, kuriose negalima kelti triukšmo. Klausos apsauga nereikalinga. STIHL greitasis grandinės įtempimas, &quot;QuickStop Super&quot; grandinės stabdys, be įrankių uždaromas degalų bako dangtelis, su 1/4 colių PM3 pjovimo grandine puikiam ir galingam pjūviui, svoris 3,3 kg.', 'MSA 200 C-BQ', '2021-01-06 12:51:35', 1, 27, 318, 2, NULL, NULL),
(28, NULL, 'MSA 220 C-BQ', NULL, NULL, 'MSA 220 C-B yra galingiausias STIHL akumuliatorinis grandininis pjūklas. Aukščiausio lygio pjovimas ir našumas leidžia dirbti greitai ir be pertraukų - pjaunant ir genint mažo skersmens medieną, prižiūrint jaunus medžius ir krūmus. Grandinės greitis iki 24 m/s užtikrina greitą darbo eigą. Aukščiausios savybės padaro šį gaminį ypač tvirtą ir tinkamą naudoti bet kokiomis oro sąlygomis. Tai puikus akumuliatorinis pjūklas reikliems vartotojams. Šiam pjūklui rekomenduojamas naujasis akumuliatorius AP 300 S, kad užtikrintų aukščiausią pjūklo pjovimo efektyvumą ir leidžia jį naudoti profesionaliam darbui kartu su kitais profesionaliais STIHL AP serijos įrankiais.', 'MSA 220 C-BQ', '2021-01-06 12:51:35', 1, 28, 318, 2, NULL, NULL),
(29, NULL, 'MSE 141 C', NULL, NULL, 'Patogus, lengvas, gerai pjaunantis pradedantiesiems tinkamas modelis. Ergonomiškas, skirtas jėgas taupančiam darbui, šoninis grandinės įtempimas, skirtas saugiai ir lengvai įtempti grandinę, grandinės stabdys „QiuckStop Super“, alyvos bakelis su skaidriu langeliu, apsauga nuo perkrovos.', 'MSE 141 C', '2021-01-06 12:51:35', 1, 29, 318, 2, NULL, NULL),
(30, NULL, 'MSE 170 C-Q', NULL, NULL, 'Didesnio našumo elektrinis grandininis pjūklas. Labai ergonomiškas, tausojančiam jėgas darbui, grandinės stabdys „QuickStop Super“, švelni rankena geram laikymui ir maloniam darbui, be įrankių atsukamas alyvos bakelio dangtelis paprastam ir saugiam pjovimo grandinės tepalui įpilti, apsauga nuo perkrovų.', 'MSE 170 C-Q', '2021-01-06 12:51:36', 1, 30, 318, 2, NULL, NULL),
(31, NULL, 'MSE 190 C-Q', NULL, NULL, 'Didesnio našumo pjūklas, tinkantis statybos darbams ir malkoms pjaustyti. Optimaliai ergonomiški, jėgas tausojančiam darbui, grandinės stabdys „QuickStop Super“, atleidus galinę rankeną, pjovimo grandinė iš karto sustoja, švelni rankena geram laikymui ir maloniam darbui, apsauga nuo perkrovų.', 'MSE 190 C-Q', '2021-01-06 12:51:36', 1, 31, 318, 2, NULL, NULL),
(32, NULL, 'MSE 210 C-BQ', NULL, NULL, 'Stiprus, galingas elektrinis pjūklas, labai ergonomiškas, tausojančiam jėgas darbui. Grandinės greitasis įtempimas greitam ir saugiam grandinės įtempimui be įrankių, švelni rankena maloniam darbui, grandinės stabdys „QuickStop Super“, be įrankių atsukamas bako dangtelis paprastam ir saugiam pjovimo grandinės tepalu įpilti, apsauga nuo perkrovos.', 'MSE 210 C-BQ', '2021-01-06 12:51:36', 1, 32, 318, 2, NULL, NULL),
(33, NULL, 'HS 56 C-E', NULL, NULL, 'Puikiai tinka profesionaliems sodininkams ir ūkininkams. STIHL antivibracinė sistema. STIHL „ErgoStart“. Ilgalaikė oro filtravimo sistema. „2-MIX“ variklis. Be įrankių atidaromas degalų bako dangtelis. Išgaląstos abejos pjovimo peilių ašmenų pusės. Integruota apsauga nuo pjovimų ir ašmenų galo apsauga.', 'MSE 230 C-BQ', '2021-01-06 12:51:36', 1, 33, 318, 2, NULL, NULL),
(34, NULL, 'MSE 230 C-BQ', NULL, NULL, 'Galingas elektrinis grandininis pjūklas statybos darbams iš medžio. STIHL grandinės greitasis įtempimas greitam ir saugiam grandinės įtempimui be įrankių, grandinės stabdys „QuickStop Super“, todėl atleidus galinę rankeną, pjovimo grandinė iš karto sustoja. Švelni rankena maloniam darbui, šviesos diodų perkrovos indikatorius.', 'MSE 250 C-Q', '2021-01-06 12:51:36', 1, 34, 318, 2, NULL, NULL),
(35, NULL, 'MSE 250 C-Q', NULL, NULL, 'Galingiausias STIHL grandininis pjūklas sudėtingiausiems statybos iš medžio darbams. 3/8 colių RS3 pjovimo grandinė užtikrina didelį pjovimo našumą, šoninis grandinės įtempimas, visiškai elektroninis variklio valdymas, švelni rankena maloniam darbui, grandinės stabdys „QuickStop Super“, šviesos diodų perkrovos indikatorius.', 'HS 45', '2021-01-06 12:51:36', 1, 35, 318, 2, NULL, NULL),
(36, NULL, 'HS 45', NULL, NULL, 'Modelis pradedantiesiems, skirtas krūmų ir gyvatvorių priežiūrai sode. STIHL antivibracinė sistema. STIHL „ElastoStart“. Ilgalaikė oro filtravimo sistema. „2-MIX“ variklis. Išgaląsta viena pjovimo peilių pusė. Integruota apsauga nuo įpjovimų.', 'HS 45', '2021-01-06 12:51:36', 1, 36, 318, 2, NULL, NULL),
(37, NULL, 'HS 82', NULL, NULL, NULL, 'HS 82', '2021-01-06 12:51:36', 1, 37, 318, 2, NULL, NULL),
(38, NULL, 'HS 82', NULL, NULL, 'Profesionalus įrenginys. Nedidelis peilio greitis galingesniam pjūviui. „2-MIX“ variklis, STIHL antivibracinė sistema, ilgalaikė oro filtravimo sistema, iš dviejų pusių užaštrintas peilis, pjaunantis ir atbuline eiga, pasukama daugiafunkcė rankena, prisukama apsauga nuo įpjovimų ir ašmenų galo apsauga, stabdymo mygtukas.', 'HS 82', '2021-01-06 12:51:36', 1, 38, 318, 2, NULL, NULL),
(39, NULL, 'HSA 26', NULL, NULL, 'Lengvos ir kompaktiškos akumuliatorinės žirklės su krūmynų peiliu,skirtos apkarpyti ir prižiūrėti mažesnes ir visžales gyvatvores bei mažalapius dekoratyvinius medžius. Optimizuotos STIHL peilių geometrijos krūmynų peiliai optimaliam rezultatui pasiekti. Su žolės peiliu apipjauti ir vejos kraštams. Neslidi valdymo rankena užtikrina puikią ergonomiką, greitai be įrankių keičiami peiliai, įkrovos būsenos indikatorius, kad bet kuriuo metu būtų žinoma likusi akumuliatoriaus talpa. Akumuliatorius AS 2 tinka tik AS sistemos produktams,bet nesuderinamas su HSA 25.\n\nRinkinyje:\n1 x ličio jonų akumuliatorius AS 2, 28 Wh, 10,8 V\n1 x standartinis įkroviklis AL 1\n1 x krūmynų peilis, pjovimo ilgis 20 cm, įsk. peilio apsaugą\n1 x žolės peilis, pjovimo plotis 12 cm, įsk. peilio apsaugą\n1 x juodas / oranžinis gabenimo krepšys su ąselėmis tvirtinti prie sienos', 'HS 82', '2021-01-06 12:51:36', 1, 39, 318, 2, NULL, NULL),
(40, NULL, 'HSA 45', NULL, NULL, 'Labai lengvos, puikiai pjaunančios akumuliatorinės gyvatvorių\nžirklės. Iš vienos pusės užaštrinti peiliai, tarpas tarp dantukų 24 mm, sumontuota apsauga nuo įpjovimo, prisukama ašmenų galo apsauga, įmontuotas akumuliatorius, su įkrovos indikatoriumi, svoris 2,3 kgc. Akumuliatoriaus įkrovimo laikas 145 min / 210 min (80 % /100 %).', 'HS 82', '2021-01-06 12:51:36', 1, 40, 318, 2, NULL, NULL),
(41, NULL, 'HSA 56', NULL, NULL, 'Lengvos, gero pjovimo našumo akumuliatorinės gyvatvorių žirklės  gyvatvorei ir krūmams karpyti aplink namus. Lengva naudoti. Tyliai veikia. Nereikalinga klausos apsauga . Abiem ašmenų pusėmis pjaunantis peilis. Novatoriška, lašo formos peilio geometrija užtikrina geresnį šakelių sugriebimą.', 'HSA 56', '2021-01-06 12:51:36', 1, 41, 318, 2, NULL, NULL),
(42, NULL, 'HSA 66', NULL, NULL, 'Akumuliatorinės gyvatvorių žirklės yra lengvos ir labai efektyvios.\nUžtikrina vienodą peilių eigą net ir dirbant sudėtingiausius darbus.\n30 mm atstumas tarp lašo formos peilių dantukų užtikrina\ngeresnį šakų suėmimą. Pjovimo peilis išgaląstas iš vienos pusės.\nIntegruota apsauga nuo įpjovimų. Prisukama viršūnės apsauga.\nSvoris 3,1 kg', 'HSA 66', '2021-01-06 12:51:37', 1, 42, 318, 2, NULL, NULL),
(43, NULL, 'HSA 86', NULL, NULL, 'HSA 86 akumuliatorinės gyvatvorių žirklės yra lengvesnės, dar galingesnės ir veiksmingesnės nei jų pirmtakės. Užtikrina pastovų kirtimo dažnį, genėjant storas gyvatvores. STIHL EC variklis taip pat užtikrina ilgesnį veikimo laiką už ankstesnį modelį. 33mm dantukų tarpai ir didesni intervalai pjovimo kreiptuve palengvina storų šakelių pjovimą. Pjovimo ašmenys su dviašmeniais dantukais.', 'HSA 86', '2021-01-06 12:51:37', 1, 43, 318, 2, NULL, NULL),
(44, NULL, 'HSA 94', NULL, NULL, NULL, 'HSA 94', '2021-01-06 12:51:37', 1, 44, 318, 2, NULL, NULL),
(45, NULL, 'HSE 42', NULL, NULL, 'Idealiai tinka šakelėms ir plonesnėms šakoms smulkinti ir pjauti. Integruota apsauga nuo įpjovimų. Nedidelė rankų apsauga. Mechaninis peilių stabdys. Išgaląsta viena pjovimo peilių ašmenų pusė. Įtempimo kompensavimas su fiksatoriumi.', 'HSA 94', '2021-01-06 12:51:37', 1, 45, 318, 2, NULL, NULL),
(46, NULL, 'HSE 52', NULL, NULL, 'Puikiai tinka šakelėms ir plonesnėms šakoms smulkinti ir pjauti. Integruota apsauga nuo įpjovimo, prisukama ašmenų apsauga, nedidelė rankų apsauga, mechaninis peilių stabdys, išgaląsta viena ašmenų pusė, įtempimo kompensavimas. Ašmenų galo apsauga.', 'HSE 52', '2021-01-06 12:51:37', 1, 46, 318, 2, NULL, NULL),
(47, NULL, 'HSE 61', NULL, NULL, '5 padėčių pasukama rankena lanksčiam, patogiam pjovimui. Integruota apsauga nuo įpjovimų. Prisukama ašmenų apsauga. Koto ilgintuvas. Išgaląsta viena pjovimo peilių ašmenų pusė. Maža vibracija. Įtempimo kompensavimas.', 'HSE 61', '2021-01-06 12:51:37', 1, 47, 318, 2, NULL, NULL),
(48, NULL, 'HSE 71', NULL, NULL, 'Tinka storesnėms šakoms kirpti. Integruota apsauga nuo įpjovimų. Prisukama ašmenų galo apsauga. Koto ilgintuvas. Išgaląsta viena pjovimo peilių ašmenų pusė. 5 padėčių pasukama rankena. Maža vibracija. Įtempimo kompensavimas.', 'HSE 71', '2021-01-06 12:51:37', 1, 48, 318, 2, NULL, NULL),
(49, NULL, 'HLA 56', NULL, NULL, 'Lengvas akumuliatorinis karpytuvas aukštesnėms gyvatvorėms ir krūmams namuose. Reguliuojamas ašmenų kampas nuo -45 ° iki + 90 °, reguliuojamas koto ilgis, skirtas lengvai transportuoti. Transportavimo ilgis: 115 cm. Bendras ilgis: 210 cm.', 'HLA 56', '2021-01-06 12:51:37', 1, 49, 318, 2, NULL, NULL),
(50, NULL, 'HLA 65', NULL, NULL, 'Akumuliatorinis karpytuvas aukštoms ir plačioms gyvatvorėms. Pastovi peilių eiga nepriklausanti nuo apkrovos, galima sulenkti, idealiai nustatomos gyvatvorių viršaus, šonų ir apačios kirpimui, iki 115° pasukama kirpimo juosta, toli pasiekianti, peiliai išgaląsti iš abiejų pusių, ilgis gabenimo padėtyje 205 cm, svoris 3,5 kg.', 'HLA 65', '2021-01-06 12:51:37', 1, 50, 318, 2, NULL, NULL),
(51, NULL, 'HLA 85', NULL, NULL, 'Aukštai pasiekiantis akumuliatorinis karpytuvas su teleskopiniu kotu skirtas profesionalams. Švelniai reguliuojamas greitis, idealiai nustatomas gyvatvorių viršaus, šonų ir apačios kirpimui, iki 115° pasukama kirpimo juosta, peiliai galąsti iš abiejų pusių, juostos ilgis reguliuojamas be įrankių naudojant greito įtempimo svirtį, ilgis gabenimo padėtyje 108 cm, bendras ilgis 206-330 cm, svoris 4,4 kg.', 'HLA 85', '2021-01-06 12:51:37', 1, 51, 318, 2, NULL, NULL),
(52, NULL, 'HLA 135', NULL, NULL, NULL, 'HLA 135', '2021-01-06 12:51:37', 1, 52, 318, 2, NULL, NULL),
(53, NULL, 'HT 133', NULL, NULL, 'Ypač galingi pjūviai su aukštapjove, pasižyminčia geriausiu galios ir svorio santykiu. Skirta sodininkystei bei profesionaliai medžių priežiūrai. Lengva, kompaktiška pavara su užsifiksuojančia veržle ant grandinės žvaigždutės dangtelio, 1/4 colio PM3 pjovimo grandinė, užtikrinanti maksimalią pjovimo galią, „4-MIX®“ variklis su supaprastinta užvedimo sistema. Dėka mažo svorio keturbriaunio teleskopinio koto yra labai ergonomiška ir tvirta, bendras ilgis 270 – 390 cm.', 'HT 133', '2021-01-06 12:51:37', 1, 53, 318, 2, NULL, NULL),
(54, NULL, 'HTA 66', NULL, NULL, NULL, 'HTA 66', '2021-01-06 12:51:37', 1, 54, 318, 2, NULL, NULL),
(55, NULL, 'HTA 86', NULL, NULL, NULL, 'HTA 86', '2021-01-06 12:51:38', 1, 55, 318, 2, NULL, NULL),
(56, NULL, 'HTA 135', NULL, NULL, NULL, 'HTA 135', '2021-01-06 12:51:38', 1, 56, 318, 2, NULL, NULL),
(57, NULL, 'KM 131', NULL, NULL, 'Profesionaliam naudojimui su didelio efektyvumo reikalavimais. Supaprastinta paleidimo eiga patogiam užvedimui, didesnis degalų bakas ilgesnei darbo trukmei, popierinis oro filtras,dvipusė rankena, „4-MIX®“ variklis.', 'KM 131', '2021-01-06 12:51:38', 1, 57, 318, 2, NULL, NULL),
(58, NULL, 'KM 131 R', NULL, NULL, 'Profesionaliam naudojimui, kai keliami aukšti kokybės reikalavimai. Supaprastinta paleidimo eiga patogiam užvedimui, didesnis degalų bakas ilgesnei darbo trukmei, popierinis oro filtras, kilpinė rankena, „4-MIX®“ variklis.', 'KM 131 R', '2021-01-06 12:51:38', 1, 58, 318, 2, NULL, NULL),
(59, NULL, 'KMA 130 R', NULL, NULL, 'Galingas, mažo svorio akumuliatorinis „Kombi“ variklis su dideliu sukimo momentu. Trys galios pakopos, skirtos efektyviam energijos vartojimui ir tyliems bet kokio pobūdžio darbams, nešiojimo diržas, svoris 3,2 kg.', 'KMA 130 R', '2021-01-06 12:51:38', 1, 59, 318, 2, NULL, NULL),
(60, NULL, 'KMA 135 R', NULL, NULL, NULL, 'KMA 135 R', '2021-01-06 12:51:38', 1, 60, 318, 2, NULL, NULL),
(61, NULL, 'MM 56', NULL, NULL, 'Skirtas įvairiems vejos priežiūros, dirvos apdirbimo ir paviršiaus valymo darbams. Platus STIHL „Multi“ įrankių pasirinkimas, sulankstomas rėmas lengvam gabenimui, supaprastinta paleidimo eiga patogiam įjungimui, stabdymo mygtukas, popierinis oro filtras.', 'MM 56', '2021-01-06 12:51:38', 1, 61, 318, 2, NULL, NULL),
(62, NULL, 'BF-KM dirvos freza', NULL, NULL, 'Dirvų freza tinka visiems &quot;Kombi&quot; varikliams ir FR 130 T. Lengvas kultivatorius dirbti siaurose vietose. Galėsite tiksliai apdirbti netgi mažas tarpines erdves, pavyzdžiui sodinukų lysves.', 'BF-KM dirvos freza', '2021-01-06 12:51:38', 1, 62, 318, 2, NULL, NULL),
(63, NULL, 'BG-KM pūtiklis', NULL, NULL, 'Ši unikali inovatyvi STIHL &quot;Kombi&quot; sistema leidžia transformuotis į pilnavertį galingą pūtiklį. Lygiai taip pat kaip ir kiti &quot;Kombi&quot; įrankiai šis STIHL pūtiklis gali būti kaip priedas prie &quot;Kombi&quot; sistemos variklio ir su šiuo įrankiu galima valyti teritorijas, pašalinti nukritusius lapus, nupjautą žolę, valyti purų sniegą. Skirtas visiems &quot;Kombi&quot; modeliams.', 'BG-KM pūtiklis', '2021-01-06 12:51:38', 1, 63, 318, 2, NULL, NULL),
(64, NULL, 'FCB-KM pakraščių karpytuvas', NULL, NULL, NULL, 'FCB-KM pakraščių karpytuvas', '2021-01-06 12:51:38', 1, 64, 318, 2, NULL, NULL),
(65, NULL, 'FH-KM krūmynų karpytuvas', NULL, NULL, 'Pjovimui pažeme nedidelėse erdvėse bei intensyvaus eismo zonoje. Lankstus reguliavimo mechanizmas, taupanti erdvę transportavimo padėtis.', 'FH-KM krūmynų karpytuvas', '2021-01-06 12:51:38', 1, 65, 318, 2, NULL, NULL),
(66, NULL, 'FS-KM žoliapjovė', NULL, NULL, 'Puikiai tinka pievelėms su tankia žole. GSB 230-2 žolės pjovimo peilis, svoris 1,2 kg.', 'FS-KM žoliapjovė', '2021-01-06 12:51:38', 1, 66, 318, 2, NULL, NULL),
(67, NULL, 'HL-KM gyvatvorių žirklės', NULL, NULL, 'Sudėtingiems darbams, dailinant aukštą gyvatvorę bei pjovimui pažeme. Nuosekliai nustatomas reguliavimo mechanizmas, taupanti erdvę transportavimo padėtis, pjovimo ilgis 50 cm, bendras ilgis 148 cm, svoris 2,3 kg.', 'FS-KM žoliapjovė', '2021-01-06 12:51:38', 1, 67, 318, 2, NULL, NULL),
(68, NULL, 'HT-KM aukštapjovė', NULL, NULL, 'Greitai galima apipjaustyti medžius ir krūmokšnius. Šoninis įtempimas palengvina grandinės įtempimo reguliavimą. Alyvos bako kamščiai turi laikiklius, kurie neleidžia pamesti kamščio. Galimas prailginimo kotas. Skirtas visiems kombi įrenginiams su kilpine rankena.', 'HT-KM aukštapjovė', '2021-01-06 12:51:38', 1, 68, 318, 2, NULL, NULL),
(69, NULL, 'KB-KM šluota', NULL, NULL, 'Tvirti šeriai pasiekia nešvarumus net iš gilių griovelių ir vagelių. Dėl priešingos šepečio sukimosi krypties nešvarumai stumiami į priekį. Tinka visiems modeliams.', 'KB-KM šluota', '2021-01-06 12:51:38', 1, 69, 318, 2, NULL, NULL),
(70, NULL, 'RG-KM karpytuvas', NULL, NULL, '„Kombi“ įrankiu „RG-KM“ pašalinsite piktžoles, augančias tiek žvyre, tiek ant asfalto ar asfaltuotų paviršių. „RG-KM“ būdingas efektyvaus veikimo principas: viršutiniai ir apatiniai ašmenys juda maždaug 30 ° vienas į kitą pirmyn ir atgal. Dėl mažos sukimosi energijos bei nedidelio sukimosi greičio juo galima apipjauti šalikeles, šaligatvius ar eismo saleles, saugus atstumas iki daiktų, transporto priemonių sumažėja iki 3 metrų, o iki žmonių siekia 5 metrus. Be to, galimybė užsikimšti pjaunama mase itin maža. Iki šiol ravėjimas dažnai buvo sunkus darbas, tačiau dirbant su galinga „RG-KM“, dabar tai atlikti nesunku ir efektyvu beveik kaip ravint rankomis.', 'RG-KM karpytuvas', '2021-01-06 12:51:38', 1, 70, 318, 2, NULL, NULL),
(71, NULL, 'BF-MM dirvos freza', NULL, NULL, 'Smulkina sunkią, molingą dirvą. Idealiai tinka kultivuoti iš naujo ir purenti, darbinis plotis 22 cm, svoris 2,0 kg.', 'BF-MM dirvos freza', '2021-01-06 12:51:38', 1, 71, 318, 2, NULL, NULL),
(72, NULL, 'BK-MM purentuvas', NULL, NULL, 'Paskirsto lengvą smėlėtą dirvą ir susmulkina grumstus. Puikiai tinka smulkiems darbams, pvz. tarp augančių augalų.', 'BK-MM purentuvas', '2021-01-06 12:51:38', 1, 72, 318, 2, NULL, NULL),
(73, NULL, 'FC-MM pakraščių karpytuvas', NULL, NULL, 'Lygiai nupjauna vejos pakraščius iki šaknų. Taip pat tinka išpjauti vejos lopinius, kuriuos reikia atsodinti.', 'FC-MM pakraščių karpytuvas', '2021-01-06 12:51:38', 1, 73, 318, 2, NULL, NULL),
(74, NULL, 'KB-MM šepetys', NULL, NULL, 'Kruopščiai šalina nešvarumus nuo paviršių su plyšiais ar nelygių natūralių akmeninių paviršių.', 'KB-MM šepetys', '2021-01-06 12:51:38', 1, 74, 318, 2, NULL, NULL),
(75, NULL, 'KW-MM cilindrinis šepetys', NULL, NULL, 'Nuo lygių paviršių kruopščiai pašalina birias medžiagas, smėlį, akmenukus ir lapus. Idealiai tinka šaligatviams ir gatvėms šluoti.', 'KW-MM cilindrinis šepetys', '2021-01-06 12:51:38', 1, 75, 318, 2, NULL, NULL),
(76, NULL, 'MF-MM samanų šalintuvas', NULL, NULL, 'samanų šalinimo įtaisas, samanu naikinimas, multi įrankis, stihl multi sistema, multi sistemos priedai', 'MF-MM samanų šalintuvas', '2021-01-06 12:51:39', 1, 76, 318, 2, NULL, NULL),
(77, NULL, 'RL-MM aeratorius', NULL, NULL, 'Pagerinamas šaknų augimas. Perforuoja žolės paviršių ir užtikrina optimalų aprūpinimą maistingomis medžiagomis bei ventiliavimu, darbinis plotis 20 cm, svoris 2,0 kg.', 'RL-MM aeratorius', '2021-01-06 12:51:39', 1, 77, 318, 2, NULL, NULL),
(78, NULL, 'TS 410', NULL, NULL, 'STIHL TS 410 - kompaktiškas ir tvirtas pjaustytuvas. Įrenginys turi galingą variklį, kompaktišką dizainą, lengvą užvedimo sistemą &quot;ElastoStart&quot;, kuro pompą, dekompresinį vožtuvą bei ilgalaikę filtravimo sistemą su cikloninu oro valymu - dėl to žymiai pailgėja filtro naudojimas ir priežiūros intervalai. Ypatingai maža vibracija (3.9 m/s²) ir optimizuotas balansas padeda atlikti tikslų pjūvį. Be įrankių atidaromas kamštis. Komplektuojamas su 300 mm pjovimo diskeliu. Gali būti naudojamas su vežimėliu FW 20.', 'GTA 26', '2021-01-06 12:51:39', 1, 78, 318, 2, NULL, NULL),
(79, NULL, 'TS 420', NULL, NULL, 'STIHL TS 420 - kompaktiškas ir tvirtas pjaustytuvas. Įrenginys turi galingą variklį, kompaktišką dizainą, lengvą užvedimo sistemą &quot;ElastoStart&quot;, kuro pompą, dekompresinį vožtuvą bei ilgalaikę filtravimo sistemą su cikloninu oro valymu - dėl to žymiai pailgėja filtro naudojimas ir priežiūros intervalai. Ypatingai maža vibracija (3.9 m/s²) ir optimizuotas balansas padeda atlikti tikslų pjūvį. Be įrankių atidaromas kamštis. Komplektuojamas su 350 mm pjovimo diskeliu. Gali būti naudojamas su vežimėliu FW 20.', 'TS 420', '2021-01-06 12:51:39', 1, 79, 318, 2, NULL, NULL),
(80, NULL, 'TS 500i', NULL, NULL, 'Pirmasis pasaulyje tokio tipo įrenginys su pilna kuro įpurškimo sistema &quot;STIHL Injection&quot;. Naujoviškas 3,9 kW pjaustytuvas pasižymi dideliu sukimo momentu ir yra lengvai paleidžiamas, turi sumontuotą ilgalaikę oro filtravimo sistemą ir elektroninį vandens valdiklį. Komplektuojamas su 350 mm pjovimo disku. Valdomas rankomis arba galima naudoti su vežimėliu FW 20.', 'TS 500i', '2021-01-06 12:51:39', 1, 80, 318, 2, NULL, NULL),
(81, NULL, 'TS 700', NULL, NULL, 'Galingas 5,0 kW pjaustytuvas sukurtas našiam darbui statybose. Įrenginys turi lengvo užvedimo sistemą &quot;ElastoStart &quot;, kompensacinį ir dekompresinį vožtuvą, be to, dėl oro filtravimo sistemos su cikloniniu valymu - oro filtro tarnavimo laikas tampa ypač ilgas bei taip sumažindamas techninės priežiūros intervaralų skaičių. Komplektuojamas su 350 mm pjovimo disku. Valdomas rankomis arba stumiamu vežimėliu FW 20.', 'TS 700', '2021-01-06 12:51:39', 1, 81, 318, 2, NULL, NULL),
(82, NULL, 'TS 800', NULL, NULL, 'Galingas 5,0 kW pjaustytuvas sukurtas našiam darbui statybose. Įrenginys turi lengvo užvedimo sistemą &quot;ElastoStart &quot;, kompensacinį ir dekompresinį vožtuvą, be to, dėl oro filtravimo sistemos su cikloniniu valymu - oro filtro tarnavimo laikas tampa ypač ilgas bei taip sumažindamas techninės priežiūros intervaralų skaičių. Komplektuojamas su 400 mm pjovimo disku. Valdomas rankomis arba stumiamu vežimėliu FW 20.', 'TS 800', '2021-01-06 12:51:39', 1, 82, 318, 2, NULL, NULL),
(83, NULL, 'TSA 230', NULL, NULL, 'Pirmasis pasaulyje akumuliatorinis pjaustytuvas su vandens\npadavimu, 230 mm pjovimo diskas. Skirtas lauko ir vidaus\ndarbams, pjovimo gylis iki 70 mm, vandens jungtis su rutuliniu\nvožtuvu ir žarnos mova, veleno fiksavimo įtaisu, nereikalaujanti\npriežiūros diržinė pavara, svoris 3,9 kg.\nTSA 230 be akumuliatoriaus ir įkroviklio', 'TSA 230', '2021-01-06 12:51:39', 1, 83, 318, 2, NULL, NULL),
(84, NULL, 'GS 461', NULL, NULL, 'Motorinio pjūklo ir pjaustytuvo derinys: toks yra naujasis STIHL pjoviklis GS 461. Pirmiausia pasižymi geru galios ir svorio santykiu, dideliu pjovimo gyliu, galimybe atlikti tikslius pjūvius kampuose ir sunkiai prienamose vietose. Idealiai tinka pjauti betonui, mūrui, betoniniams ar plastiškiems ketaus vamzdžiams ir kita. Pjovimo juosta pritaikyta sunkiam darbui. Jos priekyje yra nukreipti vandens kanalai gersniam aušinimui. Speciali deimantinė pjovimo grandinė variklio galią paverčia optimalia pjovimo galia.', 'GS 461', '2021-01-06 12:51:39', 1, 84, 318, 2, NULL, NULL),
(85, NULL, 'FS 38', NULL, NULL, 'Lengviausia STIHL asortimento žoliapjovė. Puikiai tinka pjauti pievos kraštus. Daugiafunkcė lanko formos rankena. „2-MIX“ variklis.', 'FS 38', '2021-01-06 12:51:39', 1, 85, 318, 2, NULL, NULL),
(86, NULL, 'FS 40', NULL, NULL, 'Viena iš lengviausių, naujos kartos žoliapjovė. Moderni išorė, patogus valdymas ir labai paprasta užvedimo sistema - šios savybės yra svarbiausios STIHL naujos kartos žoliapjovių serijoje. Veiksmų skaičius, reikalingas užvesti žoliapjovę, buvo ženkliai sumažintas. Naujas 2-taktis variklis su degiojo mišinio recirkuliacija duoda greitą akseleraciją, mažą išmetamųjų dujų emisiją, sumažina degalų suvartojimą. Lanko formos rankena ir &quot;AutoCut&quot; pjovimo galva idealiai tinka pjauti mažus žolės plotus.', 'FS 40', '2021-01-06 12:51:39', 1, 86, 318, 2, NULL, NULL),
(87, NULL, 'FS 50', NULL, NULL, 'Viena iš lengviausių naujos kartos žoliapjovių. Moderni išorė, patogus valdymas ir labai paprasta užvedimo sistema - šios savybės yra svarbiausios STIHL naujos kartos žoliapjovių serijoje. Veiksmų skaičius, norint užvesti krūmapjovę, buvo ženkliai sumažintas. Naujas 2-taktis variklis su degiojo mišinio recirkuliacija duoda greitą akseleraciją, mažą išmetamųjų dujų emisiją, sumažina degalų suvartojimą. Lanko formos rankena ir &quot;Autocut&quot; pjovimo galva idealiai tinka pjauti mažus žolės plotus. Idealiai tinka apipjauti kampus. Lanko formos rankena gali būti lengvai reguliuojama be jokių papildomų priedų.', 'FS 50', '2021-01-06 12:51:39', 1, 87, 318, 2, NULL, NULL),
(88, NULL, 'FS 55', NULL, NULL, 'Komfortabiliam darbui siaurose vietose. Daugiafunkcė rankena, dvipusė rankena, rankenos reguliavimas nenaudojant įrankių, „2 MIX“ variklis, paprastas nešiojimo diržas.', 'FS 55', '2021-01-06 12:51:39', 1, 88, 318, 2, NULL, NULL),
(89, NULL, 'FS 56', NULL, NULL, 'Naujos kartos motorinė žoliapjovė. Moderni išorė, patogus valdymas ir labai paprasta užvedimo sistema - šios savybės yra svarbiausios STIHL naujos kartos žoliapjovių serijoje. Veiksmų skaičius, norint užvesti žoliapjovę, buvo ženkliai sumažintas. Naujas 2-taktis variklis su degiojo mišinio recirkuliacija duoda greitą akceleraciją, mažą išmetamųjų dujų emisiją, sumažina degalų suvartojimą. Standartiškai komplektuojama su reguliuojamomis plačiomis rankenomis.', 'FS 56', '2021-01-06 12:51:40', 1, 89, 318, 2, NULL, NULL),
(90, NULL, 'FS 70', NULL, NULL, 'Ypatingai tvirta 0.9 kW galios benzininė krūmapjovė su plačiomis rankenomis. 2-Mix variklis sunaudoja 20% mažiau kuro ir išmeta 70% mažiau kenksmingų medžiagų lyginant su įprasta 2-Mix technologija. ErgoStart sistema palengvina užvedimą. Optimizuotas pjovimo kampas.', 'FS 70', '2021-01-06 12:51:40', 1, 90, 318, 2, NULL, NULL),
(91, NULL, 'FS 89', NULL, NULL, 'Skirta pjauti kietą žolę. Supaprastintas variklio paleidimas patogiam užvedimui, dvipusė rankena, valdymo rankena su stabdymo mygtuku, „4-MIX®“ variklis su didesniu degalų baku ilgesniam veikimui, lankstus pavaros velenas, dvipetis diržas.', 'FS 89', '2021-01-06 12:51:40', 1, 91, 318, 2, NULL, NULL),
(92, NULL, 'FS 91', NULL, NULL, 'Skirta pjauti kietą žolę. Supaprastintas variklio paleidimas patogiam užvedimui, dvipusė rankena, valdymo rankena su stabdymo mygtuku, „4-MIX®“ variklis su didesniu degalų baku ilgesniam veikimui, standus pavaros velenas, dvipetis diržas.', 'FS 91', '2021-01-06 12:51:40', 1, 92, 318, 2, NULL, NULL),
(93, NULL, 'FS 94', NULL, NULL, 'Lengviausia vidutinės galios krūmapjovė šiame segmente. STIHL 1-taško anti-vibracijos sistema, ErgoStart, dviračio rankena, valdymo rankenėlė su „EcoSpeed“ iš dalies pakrauta funkcija, STIHL 2-MIX varikliu, tiesiu velenu.', 'FS 94', '2021-01-06 12:51:40', 1, 93, 318, 2, NULL, NULL),
(94, NULL, 'FS 111', NULL, NULL, 'Galinga žoliapjovė, skirta pjauti kietą žolę. Supaprastintas variklio paleidimas patogiam užvedimui, dvipusė rankena, valdymo rankena su stabdymo mygtuku, „4-MIX®“ variklis su didesniu degalų baku ilgesniam veikimui, standus pavaros velenas, dvipetis diržas.', 'FS 111', '2021-01-06 12:51:40', 1, 94, 318, 2, NULL, NULL),
(95, NULL, 'FS 120', NULL, NULL, 'Puikus balansas ir išskirtinis galios bei svorio santykis. Standus velenas užtikrina didelį našumą visą darbo dieną. Elastostart funkcija užtikrina lengvą paleidimą.', 'FS 120', '2021-01-06 12:51:40', 1, 95, 318, 2, NULL, NULL),
(96, NULL, 'FS 131', NULL, NULL, 'Ypač galinga žoliapjovė, skirta pjauti kietą žolę. Supaprastintas variklio paleidimas patogiam užvedimui, dvipusė rankena, valdymo rankena su stabdymo mygtuku, „4-MIX®“ variklis su didesniu degalų baku ilgesniam veikimui, standus pavaros velenas, dvipetis diržas.', 'FS 131', '2021-01-06 12:51:40', 1, 96, 318, 2, NULL, NULL),
(97, NULL, 'FS 235', NULL, NULL, 'Tvirta ir galinga krūmapjovė. Su daugiafunkcine, dviračio tipo rankena.\nĮspūdingas pjovimo darbas. STIHL 1 taško antivibracinė sistema, automatinė dekompresija, 2-MIX variklis ir daugiafunkcė rankena.', 'FS 235', '2021-01-06 12:51:40', 1, 97, 318, 2, NULL, NULL),
(98, NULL, 'FS 240', NULL, NULL, 'Puikiai tinka žemės ūkiui ir sodininkystės darbams. STIHL vieno taško antivibracinė sistema. „ErgoStart“. Daugiafunkcė dvipusė rankena. Be įrankių reguliuojama rankenos padėtis. „2-MIX“ variklis. Tiesus kotas ir standus darbinis velenas. Dvipetis nešiojimo diržas.', 'FS 240', '2021-01-06 12:51:40', 1, 98, 318, 2, NULL, NULL),
(99, NULL, 'FS 260', NULL, NULL, 'Sunkiems, didelės apimties pjovimo darbams. STIHL vieno taško antivibracinė sistema. „ErgoStart“. Daugiafunkcė dvipusė rankena. Be įrankių reguliuojama rankenos padėtis. „2-MIX“ variklis. „ADVANCE“ universalus diržas.', 'FS 260', '2021-01-06 12:51:40', 1, 99, 318, 2, NULL, NULL),
(100, NULL, 'FS 311', NULL, NULL, 'Lengva, labai galinga krūmapjovė skirta šienauti tankiai suaugusią žolę ir brūzgynus. Supaprastintas variklio paleidimas patogiam užvedimui, dvipusė rankena, valdymo rankena su stabdymo mygtuku, „4-MIX®“ variklis, nereikalaujanti priežiūros pavara, standus pavaros velenas, „ADVANCE“ universalus diržas.', 'FS 311', '2021-01-06 12:51:41', 1, 100, 318, 2, NULL, NULL),
(101, NULL, 'FS 360', NULL, NULL, 'Patogi, tvirta ir ergonomiška krūmapjovė. Su STIHL „2-MIX“ varikliu iki 20 % mažesnės degalų sąnaudos ir iki 50 % mažiau išmetamųjų dujų, palyginti su tokios pačios galios STIHL dvitakčiais varikliais be „2-MIX“ technologijos. Idealiai tinka kietai žolei pjauti. Serijinėje komplektacijoje su naujuoju „ADVANCE PLUS“ diržu.', 'FS 360', '2021-01-06 12:51:41', 1, 101, 318, 2, NULL, NULL),
(102, NULL, 'FS 410', NULL, NULL, 'Galinga, kietos žolės pjovimui skirta krūmapjovė, FS 410 C-EM turi 4 taškų vibracijų slopinimo sistemą, „ErgoStart“ funkciją, universalią dvipusę rankeną, kurios padėtis gali būti keičiama nenaudojant papildomų įrankių, „2-MIX“ tipo galingą ir ekonomišką variklį su „M-Tronic“ sistema. Elektroninis variklio valdiklis su atminties funkcija tiksliai reguliuoja bet kokiame darbo etape uždegimo tašką ir kuro dozavimą, o taip pat užtikrina optimalią variklio galią, nuolatinį maksimalių sūkių skaičių ir labai gerą pagreitį. Krūmapjovė tiekiama su patogiu dirbti „ADVANCE“ tipo diržu.', 'FS 410', '2021-01-06 12:51:41', 1, 102, 318, 2, NULL, NULL),
(103, NULL, 'FS 460', NULL, NULL, 'Patogi, tvirta ir labai galinga krūmapjovė STIHL FS 460 C-EM serijinėje komplektacijoje su elektronine variklio valdymo sistema &quot;M-TRONIC&quot;, &quot;ErgoStart&quot; ir STIHL &quot;2-MIX&quot; varikliu. Elektroninė variklio valdymo sistema &quot;M-TRONIC&quot; pasirūpins, kad variklis dirbtų optimaliausia galia bet kuriuo momentu. Sistema reaguoja į aukščio, temperatūros, oro filtro švaros, kuro kokybės ir oktano lygio pokyčius. Taigi, nereikės mechaniškai reguliuoti karbiuratoriaus. Itin galingas, tačiau saugantis aplinką ir taupantis kurą STIHL 2-MIX variklis pasirūpina greitu ir efektyviu pjovimu.\nIdealiai tinka dideliems retinimo darbams miške. Parduodama serijinėje komplektacijoje su naujuoju &quot;ADVANCE PLUS&quot; diržu. Keturių taškų antivibracijos sistema tausoja krūmapjovės savininko jėgas ir leidžia darbuotis itin ilgai be jokio nuovargio. Populiarusis FS 460 C-EM modelis nuo STIHL FS 460 C-EM K skiriasi ilgiu, valdymo rankena ir reduktoriaus kampu.', 'FS 410', '2021-01-06 12:51:41', 1, 103, 318, 2, NULL, NULL),
(104, NULL, 'FS 490', NULL, NULL, 'Patogi, tvirta ir labai galinga krūmapjovė STIHL FS 490 C-EM pasižymi dideliu stabilumu. Serijinėje komplektacijoje su paprasta paleidimo sistema, stabdymo mygtuku ir elektronine variklio valdymo sistema &quot;M-TRONIC&quot;, &quot;ErgoStart&quot; ir STIHL &quot;2-MIX&quot; varikliu. Elektroninė variklio valdymo sistema &quot;M-TRONIC&quot; pasirūpins, kad variklis dirbtų optimaliausia galia bet kuriuo momentu. Sistema reaguoja į aukščio, temperatūros, oro filtro švaros, kuro kokybės ir oktano lygio pokyčius. Taigi, nereikės mechaniškai reguliuoti karbiuratoriaus. Itin galingas, tačiau saugantis aplinką ir taupantis kurą STIHL 2-MIX variklis pasirūpina greitu ir efektyviu pjovimu. Bendras ilgis be pjovimo įrangos 180 cm. Idealiai tinka dideliems kietos žolės plotams šienauti ir pjovimo bei retinimo darbams miške. Parduodama serijinėje komplektacijoje su naujuoju &quot;ADVANCE PLUS&quot; diržu. Keturių taškų antivibracijos sistema tausoja krūmapjovės savininko jėgas ir leidžia darbuotis itin ilgai be jokio nuovargio. FS 490 C-EM modelis nuo STIHL FS 490 C-EM K skiriasi ilgiu, valdymo rankena ir reduktoriaus kampu.', 'FS 490', '2021-01-06 12:51:41', 1, 104, 318, 2, NULL, NULL),
(105, NULL, 'FS 560', NULL, NULL, 'Stipriausia STIHL krūmapjovė profesionaliai atliekamiems pjovimo darbams prižiūrint kraštovaizdį. Itin stabilios, patvarios. FS 560 C-EM krūmapjovė su STIHL M-Tronic (su pilnai elektroniniu variklio valdymu) ir ErgoStart (lengvos paleisties funkcija) geras pasirinkimas profesionalams. Vibracijos lygis, paleidimas, stabdymo mygtukas ir variklio valdymo sistema yra pilnai elektroninė ir įeina į standartinę komplektaciją.', 'FS 490', '2021-01-06 12:51:41', 1, 105, 318, 2, NULL, NULL),
(106, NULL, 'FSA 45', NULL, NULL, 'Kompaktiška akumuliatorinė žoliapjovė nedideliems žolės pjovimams aplink namus. Integruotas akumuliatorius su pakrovimo lygio indikatoriumi, kotas ir apvali rankena reguliuojasi be papildomų įrankių. Reguliuojasi pjovimo galvos kampas – patogu vertikaliems pjovimams. Lengva pakeisti darbinę įrangą iš PolyCut į pjovimo valą ir atvirkščiai.', 'FS 490', '2021-01-06 12:51:41', 1, 106, 318, 2, NULL, NULL),
(107, NULL, 'FSA 57', NULL, NULL, 'Labai lengva ir lengvai naudojama akumuliatorinė krūmapjovė vejos priežiūrai ir vejos kraštams aplink jūsų namus. Pjovimo galvutės skersmuo 280 mm, reguliuojamas veleno ilgis spaustelėjus mygtuką ir rankenos reguliavimas be papildomų įrankių. Paprastas vejos pjovimas aplink kliūtis, medžius ir krūmus. Minkšta rankena patogiam naudojimui. AutoCut C 3-2 pjovimo galvutė, kurią paprasta papildyti valu be jokių įrankių. Taip pat galima naudoti „PolyCut 3-2“ su plastikiniais ašmenimis.', 'FSA 57', '2021-01-06 12:51:41', 1, 107, 318, 2, NULL, NULL),
(108, NULL, 'FSA 60 R', NULL, NULL, NULL, 'FSA 60 R', '2021-01-06 12:51:41', 1, 108, 318, 2, NULL, NULL),
(109, NULL, 'FSA 86 R', NULL, NULL, NULL, 'FSA 86 R', '2021-01-06 12:51:41', 1, 109, 318, 2, NULL, NULL),
(110, NULL, 'FSA 90', NULL, NULL, 'Akumuliatorinė žoliapjovė tvirtos žolės pjovimui. Pjovimo disko skersmuo 380 mm su pjovimo galvute, apvalia rankena, darbinė rankena su dalinės apkrovos funkcija „ECOSPEED“, nešiojamas diržas, klausos apsauga nereikalinga, svoris 2,8 kg.', 'FSA 90', '2021-01-06 12:51:41', 1, 110, 318, 2, NULL, NULL),
(111, NULL, 'FSA 130', NULL, NULL, 'Galingas, mažo svorio akumuliatorinis „Kombi“ variklis su dideliu sukimo momentu. Trys galios pakopos, skirtos efektyviam energijos vartojimui ir tyliems bet kokio pobūdžio darbams, nešiojimo diržas, svoris 3,2 kg.', 'FSA 90', '2021-01-06 12:51:42', 1, 111, 318, 2, NULL, NULL),
(112, NULL, 'FSA 135', NULL, NULL, NULL, 'FSA 135', '2021-01-06 12:51:42', 1, 112, 318, 2, NULL, NULL),
(113, NULL, 'FSE 31', NULL, NULL, 'Labai lengva ir tyli elektrinė žoliapjovė. Su reguliuojama rankena ir palenkiama pjovimo galvute. Puikiai tinka apipjovimo ir valymo darbams aplinkoje, kurioje negalima kelti triukšmo.', 'FSA 135', '2021-01-06 12:51:42', 1, 113, 318, 2, NULL, NULL),
(114, NULL, 'FSE 52', NULL, NULL, 'Šiuolaikiško ir funkcionalaus dizaino, lengva, tyli ir galinga elektrinė žoliapjovė su patobulinta konstrukcija - apsauginis atstumo lankas iš vielos. Nauja &quot;AutoCut 2-2&quot; pjovimo galvutė. Idealiai tinkama pjovimo ir valymo darbams sode.', 'FSE 52', '2021-01-06 12:51:42', 1, 114, 318, 2, NULL, NULL),
(115, NULL, 'FSE 60', NULL, NULL, 'Tyli, tvirta ir galinga elektrinė žoliapjovė. Puikiai tinka pjovimo, valymo darbams ir darbui ant lygaus paviršiaus aplinkoje,kurioje negalima kelti triukšmo. Patogią pjovimo galvutę su valu „AutoCut C 5-2“ galima iš naujo papildyti valu neatidarius korpuso. Stuktelėjus į žemę valas reguliuojamas automatiškai.', 'FSE 60', '2021-01-06 12:51:42', 1, 115, 318, 2, NULL, NULL),
(116, NULL, 'FSE 81', NULL, NULL, 'Itin galinga elektrinė žoliapjovė. Su pjovimo galvute su valu „AutoCut C 5-2“, liečiamuoju apsauginiu ratuku ir patogiu dviejų dalių kotu su guminiais įdėklais ir apsauga nuo perkrovos. Puikiai tinka nedideliems laukinės augmenijos plotams šienauti, pjovimo ir valymo darbams aplinkoje, kurioje negalima kelti triukšmo.', 'FSE 81', '2021-01-06 12:51:42', 1, 116, 318, 2, NULL, NULL),
(117, NULL, 'FR 131 T', NULL, NULL, 'Universaliai naudojama, kai pjaunama sunkiai prieinamoje vietovėje. Supaprastinta paleidimo eiga patogesniam užvedimui, sudedamas kotas, skirtas taupyti erdvę transportuojant, daugiafunkcė rankena, kilpinė rankena, 4-MIX® variklis su didesniu baku, ilgesniam darbui, stabdymo mygtukas. Derinama su HL-KM, HT-KM, FH-KM, BG-KM, BF-KM, FCB-KM ir FCS-KM.', 'FR 131 T', '2021-01-06 12:51:42', 1, 117, 318, 2, NULL, NULL),
(118, NULL, 'FR 410 C-E', NULL, NULL, 'Galinga krūmapjovė su taupiai degalus vartojančiu &quot;2-MIX&quot; varikliu ir ypatingai patogia įranga: STIHL &quot;ErgoStart&quot;, stabdymo mygtuku ir papildomu krepšiu įrankiams.', 'FR 410 C-E', '2021-01-06 12:51:42', 1, 118, 318, 2, NULL, NULL),
(119, NULL, 'FR 460 TC-EM', NULL, NULL, 'Ypatingai galinga ir patogi STIHL žoliapjovė profesionalams. Dėl STIHL &quot;M-Tronic&quot; sistemos ir skirtingame aukštyje užsiveda papildomai rankiniu būdu nereguliuojant karbiuratoriaus. Su taupiai degalus vartojančiu &quot;2-MIX&quot; varikliu , STIHL &quot;Ergo Start&quot;, stabdymo mygtuku ir paildomu krepšiu įrankiams. Kotas sudedamas, todėl lengva transportuoti ir laikyti. Idealiai tinka šienavimo darbams su ilgomis kelio atkarpomis sunkiai prienama vietove.', 'FR 460 TC-EM', '2021-01-06 12:51:42', 1, 119, 318, 2, NULL, NULL),
(120, NULL, 'RMI 422', NULL, NULL, 'STIHL RMI 422 „iMOW®“ vejos pjovimo robotas buvo sukurtas mažesnėms, iki 800 m² ploto, vejoms pjauti. Siekiant užtikrinti, kad automatinė vejapjovė pjautų tiksliai, joje įtaisytas mulčiavimo agregatas ir įrengta kelių žingsnių sistema, reguliuojanti pjovimo aukštį. Prie nuolydžio prisitaikančio greičio funkcija leidžia tiksliai pjauti net tada, kai nuolydis siekia 35 %. Judantis STIHL RMI 422 „iMOW®“ vejos pjovimo roboto gaubtas su jutikliais suteikia jam tvirtumo ir apsaugo nuo pažeidimų. Į šį robotą įdiegtas dinamiškas pjovimo planas – jį galima pasiekti tiesiogiai per mašinos valdymo įtaisą.', 'RMI 422', '2021-01-06 12:51:42', 1, 120, 318, 2, NULL, NULL),
(121, NULL, 'RMI 422 P', NULL, NULL, 'STIHL RMI 422 P „iMOW®“ vejos pjovimo robotą rekomenduojama naudoti vidutinio dydžio, iki 1 500 m², vejoms pjauti. Jo didelės talpos ličio jonų akumuliatorius užtikrina ilgą veikimo laiką. Mulčiavimo agregatas pjauna veją iki nustatyto aukščio, pasitelkdamas daugelio žingsnių sistemą, reguliuojančią pjovimo aukštį. Robotas turi prie nuolydžio prisitaikančio greičio funkciją, todėl galima pjauti, net esant iki 40 % nuolydžiams. Judantis gaubtas su jutikliais saugo robotą. Galima patogiai keisti visus nustatymus, naudojantis ekranėliu.', 'RMI 422 P', '2021-01-06 12:51:42', 1, 121, 318, 2, NULL, NULL);
INSERT INTO `lite_products` (`id`, `code`, `name`, `purpose`, `short_description`, `description`, `url`, `date`, `active`, `position`, `brand_id`, `item_group`, `modification_field_name`, `item_field_name`) VALUES
(122, NULL, 'RMI 422 PC', NULL, NULL, 'STIHL RMI 422 PC „iMOW®“ vejos pjovimo robotą rekomenduojama naudoti vidutinio dydžio, iki 1700 m², vejoms pjauti. Jo didelės talpos ličio jonų akumuliatorius užtikrina ilgą veikimo laiką. Galima prieiti prie dinaminio pjovimo plano, naudojantis „iMOW®“ programėle*. Daugelio žingsnių sistema, reguliuojanti pjovimo aukštį, užtikrina puikius pjovimo rezultatus. Prie nuolydžio prisitaikančio greičio funkcija leidžia pjauti kokybiškai net tada, kai nuolydis siekia iki 40 %. Judantis gaubtas su jutikliais saugo robotą.\n\n* Apie techninius reikalavimus, norint naudotis „iMOW®“ programėle, galima plačiau pasiskaityti interneto svetainėje https://web.imow.stihl.com/systems', 'RMI 422 PC', '2021-01-06 12:51:42', 1, 122, 318, 2, NULL, NULL),
(123, NULL, 'RMI 522 C', NULL, NULL, NULL, 'RMI 522 C', '2021-01-06 12:51:42', 1, 123, 318, 2, NULL, NULL),
(124, NULL, 'RMI 632', NULL, NULL, 'STIHL RMI 632 „iMOW®“ vejos pjovimo robotas buvo sukurtas didelėms, iki 3000 m², vejoms pjauti. Jo mulčiavimo agregatą galima reguliuoti, pasitelkiant 15 skirtingų nustatymų, priklausomai nuo norimo žolės ilgio. Vejos pjovimo robotas turi prie nuolydžio prisitaikančio greičio funkciją, todėl juo galima pjauti, net esant iki 45 % nuolydžiams. Pjaunant judantis gaubtas su jutikliais saugo robotą. Nuimamas valdymo skydelis, integruotas į korpusą, turi LCD ekranėlį. Jame galima atlikti sąranką, rankiniu būdu valdyti robotą ir greitai peržiūrėti jam įdiegtą informaciją. Naudojantis ekranėliu, galima įvesti ir atnaujinti dinaminį vejos pjovimo planą.', 'RMI 632', '2021-01-06 12:51:43', 1, 124, 318, 2, NULL, NULL),
(125, NULL, 'RMI 632 C', NULL, NULL, 'STIHL RMI 632 C „iMOW®“ vejos pjovimo robotą rekomenduojama naudoti didelėms, iki 3200 m², vejoms pjauti. Pasitelkiant „iMOW®“ programėlę*, galima prieiti prie roboto dinaminio pjovimo plano iš bet kurios vietos – svarbu tik, kad joje būtų interneto ryšys. Jį taip pat galima redaguoti, pasitelkiant nuimamą valdymo skydelį, turintį LCD ekranėlį. Automatinė vejapjovė turi mulčiavimo agregatą ir prie nuolydžio prisitaikančio greičio funkciją. Tai padeda jai pasiekti visada vienodą pjovimo raštą. Judantis gaubtas su jutikliais suteikia vejos pjovimo robotui tvirtumo ir jį apsaugo. \n\n* Apie techninius reikalavimus, norint naudotis iMOW® programėle, galima plačiau pasiskaityti interneto svetainėje https://web.imow.stihl.com/systems', 'RMI 632 C', '2021-01-06 12:51:43', 1, 125, 318, 2, NULL, NULL),
(126, NULL, 'RMI 632 P', NULL, NULL, 'STIHL RMI 632 P „iMOW®“ vejos pjovimo robotas sukurtas didelėms, iki 4000 m², vejoms pjauti. Ypač didelės talpos ličio jonų akumuliatorius užtikrina nuolatinę variklio galią. Mulčiavimo agregatas visada pjauna žolę tiksliai, net esant iki 45 % nuolydžiams, nes turi prie nuolydžio prisitaikančio greičio funkciją. Automatinės vejapjovės dinaminį pjovimo planą galima sudaryti, pasitelkiant nuimamą valdymo skydelį. Judantis gaubtas su integruotais jutikliais apsaugo „iMOW®“ vejos pjovimo robotą nuo oro sąlygų ir sąlyčio su kliūtimis pjaunant.', 'RMI 632 P', '2021-01-06 12:51:43', 1, 126, 318, 2, NULL, NULL),
(127, NULL, 'RMI 632 PC', NULL, NULL, 'STIHL RM 632 PC „iMOW®“ vejos pjovimo robotas ypač tinka didelėms vejoms pjauti. Automatinė vejapjovė pasiekiama, pasitelkiant „iMOW®“ programėlę*. Naudojantis ja, taip pat galima prieiti prie dinaminio pjovimo plano iš bet kurios vietos. Be to, pjovimo planą galima pasiekti, pasitelkiant nuimamą valdymo skydelį, integruotą korpuse. RMI 632 PC ličio jonų akumuliatorius yra ypač didelės talpos. Mulčiavimo agregatas žolę pjauna visada tiksliai, net kai nuolydis siekia iki 45 %, nes turi prisitaikančio prie nuolydžio greičio funkciją.  \n\n* Apie techninius reikalavimus, norint naudotis „iMOW®“ programėle, galima plačiau pasiskaityti interneto svetainėje https://web.imow.stihl.com/systems', 'RMI 632 PC', '2021-01-06 12:51:43', 1, 127, 318, 2, NULL, NULL),
(128, NULL, 'RM 248', NULL, NULL, 'STIHL RM 248 benzininė vejapjovė tinka vidutinio dydžio vejoms pjauti. Ši vejapjovė – tai solidus pradedančiųjų modelis, turintis galingą variklį. Ji įspūdingai našiai pjauna ir surenka žolę. Ši 46 cm pjovimo pločio vejapjovė turi 55 litrų žolės surinkimo dėžę ir septynių žingsnių pjovimo aukščio reguliavimo sistemą, kurios ribos svyruoja nuo 25 iki 75 mm. RM 248 – tai kompaktiška, manevringa vejapjovė, kuriai tiksliai pjauti – nesudėtinga užduotis.', 'RM 248', '2021-01-06 12:51:43', 1, 128, 318, 2, NULL, NULL),
(129, NULL, 'RM 253', NULL, NULL, 'Nuostabu, kai, darbuodamasis sode, gali turėti šalia savęs tokį galingą pagalbininką kaip STIHL RM 253 benzininė vejapjovė. Šis kompaktiškas modelis puikiai tinka vidutinio dydžio ir didelio ploto vejoms pjauti. Benzininė vejapjovė veiksmingai nupjauna 51 cm pločio veją. RM 253 septynių žingsnių centrinė sistema, reguliuojanti pjovimo aukštį, užtikrina puikius rezultatus. Pjovimo aukštis gali svyruoti nuo 25 iki 75 mm. Galingas OHV variklis suteiks jums galimybę pasiekti įspūdingus vejos pjovimo rezultatus.', 'RM 248', '2021-01-06 12:51:43', 1, 129, 318, 2, NULL, NULL),
(130, NULL, 'RM 443', NULL, NULL, 'STIHL RM 443 benzininė 41 cm pjovimo pločio vejapjovė puikiai tinka mėgėjams sodininkams, kurie ieško mobilios, greitai judančios bei manevringos vejapjovės vidutinio dydžio vejai nupjauti. Ši vejapjovė turi atvirą, lengvai ištuštinamą žolės surinkimo dėžę su lygio indikatoriumi ir „QuickFix“ tvirtinimo įtaisus. Centrinė sistema, reguliuojanti pjovimo aukštį, leidžia tiksliai nupjauti veją. Galima rinktis iš šešių nustatymų. Jeigu norėtumėte dar ir mulčiuoti savo veją šia benzinine vejapjove, pasitelkdami priedą – atitinkamą mulčiavimo rinkinį, ją galite paversti į daugiafunkcę vejapjovę.', 'RM 443', '2021-01-06 12:51:43', 1, 130, 318, 2, NULL, NULL),
(131, NULL, 'RM 448', NULL, NULL, '46 cm pjovimo pločio STIHL RM 448 T benzininė vejapjovė, turinti 1 greičio pavarą, įspūdingai pjauna vidutinio dydžio vejas. Ši vejapjovė turi 55 litrų talpos žolės surinkimo dėžę ir integruotą lygio indikatorių, „QuickFix“ tvirtinimo įtaisus, labai minkštą rankeną ir centrinę sistemą, reguliuojančią pjovimo aukštį. Tvirtas polimero korpusas užtikrina, kad ji bus naudojama ilgą laiką.', 'RM 443', '2021-01-06 12:51:43', 1, 131, 318, 2, NULL, NULL),
(132, NULL, 'RM 545', NULL, NULL, 'STIHL RM 545 benzininė vejapjovė turi tvirtą polimero korpusą, todėl malonu pjauti vidutinio dydžio vejas. Pati vejapjovė yra labai manevringa. Septynių žingsnių centrinė sistema, reguliuojanti pjovimo aukštį, padeda lygiai nupjauti veją per 43 cm pjovimo plotį. Plastikinę 60 litrų talpos žolės surinkimo dėžę galima lengvai atidaryti ir ištuštinti, nes sukurtas specialus atidarymo mechanizmas. Integruotas lygio indikatorius praneša, kai ateina laikas išimti žolę iš surinkimo dėžės. O jeigu norite tręšti dirvą nupjauta žole, galite paverstii RM 545 benzininę vejapjovę į daugiafunkcę vejapjovę, pasitelkdami atitinkamą mulčiavimo priedą.', 'RM 545', '2021-01-06 12:51:43', 1, 132, 318, 2, NULL, NULL),
(133, NULL, 'RM 650', NULL, NULL, 'STIHL RM 650 V benzininė vejapjovė turi „Vario“ eigos sistemą, galingą variklį ir lengvo paleidimo sistemą. Ši 48 cm pjovimo pločio vejapjovė puikiai tinka didelio ploto vejoms pjauti. Vienoje jos pusėje tvirtinama rankena padeda lengviau nuimti 70 litrų žolės surinkimo dėžę. RM 650 V vejapjovė paprastai turi daugiafunkcį peilį – pasitelkiant šį įrankį, vejapjovė taip pat gali mulčiuoti.', 'RM 545', '2021-01-06 12:51:44', 1, 133, 318, 2, NULL, NULL),
(134, NULL, 'RM 655', NULL, NULL, 'STIHL RM 655 V benzininė vejapjovė turi galingą variklį, įskaitant lengvo paleidimo sistemą ir „Vario“ eigos sistemą, leidžiančią tolydžiai valdyti greitį. 53 cm pjovimo pločio vejapjovė idealiai tinka didelio ploto vejoms pjauti. Ji taip pat turi ergonomišką, vienoje pusėje tvirtinamą rankeną ir 70 litrų talpos žolės surinkimo dėžę. Šio modelio vejapjovėse taip pat standartiškai montuojamas daugiafunkcinis peilis ir mulčiavimo raktas.', 'RM 545', '2021-01-06 12:51:44', 1, 134, 318, 2, NULL, NULL),
(135, NULL, 'RM 2', NULL, NULL, 'STIHL RM 2 R benzininė mulčiavimo vejapjovė – tai manevringa vejapjovė, išsiskirianti tvirtu metaliniu korpusu, tinkamu vidutinio dydžio vejoms pjauti. Ši 46 cm pjovimo pločio vejapjovė turi „ReadyStart“ variklį. Jai taip pat būdinga kita įranga: „QuickFix“ tvirtinimo įtaisas, sulankstoma rankena, padedanti kompaktiškai sandėliuoti įrenginį, ir keturių žingsnių pjovimo aukščio nustatymas prie kiekvienos ašies.', 'RM 545', '2021-01-06 12:51:44', 1, 135, 318, 2, NULL, NULL),
(136, NULL, 'RM 3 RT', NULL, NULL, 'Manevringa STIHL RM 3 RT benzininė vejapjovė – tai galinga 3 ratų daugiafunkcė vejapjovė, turinti pasukamą priekinį ratą, paminkštintą rankeną ir 1 greičio pavarą. Ši 48 cm pjovimo pločio vejapjovė puikiai tinka didelio ploto vejoms pjauti. Joje sumontuotas „ReadyStart“ variklis. STIHL RM 3 RT vejapjovę taip pat galima paversti į šoninio iškrovimo ir mulčiavimo vejapjovę. Penkių žingsnių sistema, reguliuojanti pjovimo aukštį, užtikrina puikius vejos pjovimo rezultatus. Uždėjus „QuickFix“ tvirtinimo įtaisus ant rankenos, ją galima lengvai gabenti, be to, užima nedaug vietos sandėliuojant.', 'RM 3 RT', '2021-01-06 12:51:44', 1, 136, 318, 2, NULL, NULL),
(137, NULL, 'RM 4', NULL, NULL, 'STIHL RM 4 RT benzininė vejapjovė – tai 53 cm pjovimo pločio mulčiavimo vejapjovė, skirta didelio ploto vejoms pjauti. Mulčiavimo vejapjovė turi galingą „SmartChoke“ variklį, priekinių ratų pavarą ir ratus su dvigubais guoliais. Centrinė penkių žingsnių sistema, reguliuojanti pjovimo aukštį, kurios ribos – nuo 20 iki 70 mm, užtikrina, kad veja bus nupjauta tvarkingai .', 'RM 4', '2021-01-06 12:51:44', 1, 137, 318, 2, NULL, NULL),
(138, NULL, 'RMA 235', NULL, NULL, NULL, 'RM 4', '2021-01-06 12:51:44', 1, 138, 318, 2, NULL, NULL),
(139, NULL, 'RMA 339', NULL, NULL, NULL, 'RMA 339', '2021-01-06 12:51:44', 1, 139, 318, 2, NULL, NULL),
(140, NULL, 'RMA 443', NULL, NULL, NULL, 'RMA 339', '2021-01-06 12:51:44', 1, 140, 318, 2, NULL, NULL),
