(142, NULL, 'RMA 765 V', NULL, NULL, NULL, 'RMA 448', '2021-01-06 12:51:45', 1, 142, 318, 2, NULL, NULL),
(143, NULL, 'RMA 2 RV', NULL, NULL, NULL, 'RMA 448', '2021-01-06 12:51:45', 1, 143, 318, 2, NULL, NULL),
(144, NULL, 'RMA 2 RPV', NULL, NULL, NULL, 'RMA 2 RPV', '2021-01-06 12:51:45', 1, 144, 318, 2, NULL, NULL),
(145, NULL, 'RME 235', NULL, NULL, 'Lengva STIHL elektrinė vejapjovė RME 235 – tai 33 cm pjovimo pločio vejapjovė, ypač tinkama mažoms vejoms pjauti. Penkių žingsnių centrinė sistema, reguliuojanti pjovimo aukštį, užtikrina, kad veja bus nupjauta puikiai. Dviejų aukščių reguliuojama rankena leidžia lengvai valdyti vejapjovę pjaunant. Ją taip pat patogu lengvai ir kompaktiškai sulankstyti gabenant. RME 235 vejapjovė turi 30 litrų žolės surinkimo dėžę su lygio indikatoriumi.', 'RME 235', '2021-01-06 12:51:45', 1, 145, 318, 2, NULL, NULL),
(146, NULL, 'RME 339', NULL, NULL, 'Pjaudami su STIHL RME 339 elektrine vejapjove, jūs galite atsipalaiduoti, nes ji skleidžia mažai triukšmo. Ši vejapjovė puikiai tinka mažoms vejoms pjauti. Ji sveria vos 14 kg, todėl ją labai lengva valdyti. Centrinė penkių žingsnių sistema, reguliuojančia pjovimo aukštį, užtikrina optimalų vejos aukštį. 37 cm pjovimo plotis ir lengvai ištuštinama 40 litrų žolės surinkimo dėžė su lygio indikatoriumi padeda pasiekti geriausius vejos pjovimo rezultatus ir leidžia patogiai dirbti. Integruotas įtaisas kabelio įtempimui sumažinti garantuoja, kad kabelis bus saugiai pritvirtintas prie mašinos.', 'RME 339', '2021-01-06 12:51:45', 1, 146, 318, 2, NULL, NULL),
(147, NULL, 'RME 443', NULL, NULL, 'STIHL RM 443 benzininė vejapjovė puikiai tinka mažoms ir vidutinio dydžio vejoms pjauti. Tai – 41 cm pjovimo pločio, lengvai valdoma vejapjovė. Jos šešių žingsnių centrinė sistema, reguliuojanti pjovimo aukštį, leidžia lengvai pasiekti norimą vejos aukštį. Tvirti, lengvai pasukami ratai su specialiu kryptiniu protektoriumi suteikia papildomo patogumo. Vejapjovė turi 55 litrų talpos žolės surinkimo dėžę su lygio indikatoriumi, todėl nupjovus veją lengva sutvarkyti žolę. Taip pat nesunku atidaryti ir ištuštinti vejapjovę. Tvirtinimo įtaisais galima sulankstyti „QuickFix“ rankeną, nenaudojant jokių įrankių. Integruotos nešimo rankenos leidžia mašiną lengvai pervežti ir kompaktiškai sandėliuoti.', 'RME 339', '2021-01-06 12:51:45', 1, 147, 318, 2, NULL, NULL),
(148, NULL, 'RME 545', NULL, NULL, NULL, 'RME 545', '2021-01-06 12:51:45', 1, 148, 318, 2, NULL, NULL),
(149, NULL, 'RL 540', NULL, NULL, 'STIHL RL 540 benzininis aeratorius gerina vejos kokybę ir yra idealus pasirinkimas darbui vidutiniuose ir dideliuose žemės plotuose iki 2 000 m². Aeratoriaus darbinis plotis siekia 38 cm. Darbinis gylis gali būti reguliuojamas 6 pakopomis sulankstomoje rankenoje. Lengvas ir manevringas aeratorius su galingu benzininiu varikliu suteikia dar daugiau aeravimo jėgos veiksmingam vejos vėdinimui. RL 540 aeratorius turi ratukus lengvam riedėjimui ir tvirtą nešimo rankeną.', 'RME 545', '2021-01-06 12:51:45', 1, 149, 318, 2, NULL, NULL),
(150, NULL, 'RLA 240', NULL, NULL, 'Akumuliatorinis vejos aeratorius STIHL RLA 240 idealiai tinka aeruoti ar šukuoti mažesnes, netaisyklingos formos vejas. Kad būtų lengva valdyti, jame sumontuota „STIHL AK“ akumuliatorių sistema. Tai leidžia be laidų prižiūrėti veją ir mėgautis visišką judėjimo laisvę dirbant. Dėl 34 cm darbinio pločio aeratorius suderina didelį manevringumą ir efektyvumą - vejose su daug kampų. Tiesiog pritvirtinkite keliais paprastais žingsniais jums reikalingą įrankį, sureguliuokite darbinį gylį ir pradėkite vėdinti ar šukuoti savo veją. Visos susikaupusios augalų liekanos surenkamos į 50 litrų žolės surinkimo dėžę. Dėl lengvo ir tvirto polimerinio korpuso STIHL RLA 240 yra energiją taupantis ir labai stabilus. Dėl lengvai važiuojančių ratų jis yra labai manevringas, sulankstoma rankena palengvina transportavimą, o spyruoklinis mechanizmas palengvina ličio jonų akumuliatoriaus išėmimą iš įrenginio norint jį įkrauti ar pasidėti saugojimui.', 'RLA 240', '2021-01-06 12:51:45', 1, 150, 318, 2, NULL, NULL),
(151, NULL, 'RLE 240', NULL, NULL, 'Kompaktiškas STIHL elektrinis aeratorius RLE 240 yra idealus pasirinkimas tyliam darbui mažuose vejos plotuose iki 500 m2. Aeratoriaus peilių darbinis plotis – 34 cm, ašmenų darbinis gylis – 15 mm (aeratorius gali būti sureguliuotas rekomenduojamam maksimaliam 5 mm gyliui). Aeravimo peilius galima pakeisti į aeravimo veleną, kuris su cinkuotomis spyruoklėmis pašalina samanas ir velėną jos neįpjaudamas. Lengvas aeratorius su galingu elektriniu varikliu užtikrina efektyvų darbą, greitai ir lengvai šalina nepageidaujamas žoles ir velėną. Išaeruotos šiukšlės surenkamos į specialią dėžę. RLE 240 aeratorius turi lengvą riedėjimą užtikrinančius ratukus ir tvirtą nešimo rankeną.', 'RLE 240', '2021-01-06 12:51:45', 1, 151, 318, 2, NULL, NULL),
(152, NULL, 'MH 445', NULL, NULL, 'Kompaktiškas STIHL MH 445 kultivatorius sukurtas darbui mažuose ir vidutinio dydžio plotuose. Kultivatorius su 45 cm freza ypač tinka dirbti siauruose plotuose ir ribotose erdvėse. Kultivatoriaus sliekinė pavara perduoda galią į peilius. MH 445 modelis turi priekinę pavarą. Antivibracinė sistema ir centrinis rankenos reguliavimas užtikrina komfortišką darbą. STIHL kultivatorių lengva prižiūrėti ir valyti (frezos gali būti išmontuojamos ir sumontuojamos valymo padėtyje).', 'MH 445', '2021-01-06 12:51:45', 1, 152, 318, 2, NULL, NULL),
(153, NULL, 'MH 560', NULL, NULL, 'Galingas STIHL MH 560 kultivatorius sukurtas darbui mažose lysvėse ir vidutinio dydžio plotuose, užtikrinant itin spartų žemės apdirbimą. Darbinis frezų plotis – 60 cm. STIHL MH 560 kultivatorius turi vieną priekinę ir vieną atgalinę pavarą. Kultivatoriaus sliekinė pavara perduoda galią į peilius. Antivibracinė sistema ir centrinis rankenos reguliavimas užtikrina itin lengvą ir komfortišką darbą. Kultivatorius turi valymo padėtį, todėl jį lengva prižiūrėti.', 'MH 445', '2021-01-06 12:51:46', 1, 153, 318, 2, NULL, NULL),
(154, NULL, 'MH 585', NULL, NULL, 'Galingas STIHL MH 585 kultivatorius yra idealus pasirinkimas plataus spektro žemės darbams soduose ir laukuose. Darbinis frezų plotis – 85 cm. Šis kultivatorius turi vieną priekinę ir vieną atgalinę pavarą. Antivibracinė sistema, centrinis rankenos reguliavimas ir sliekinė pavara užtikrina išskirtinai lengvą ir komfortišką darbą. Kultivatorius lengvai transformuojamas į valymo padėtį.', 'MH 585', '2021-01-06 12:51:46', 1, 154, 318, 2, NULL, NULL),
(155, NULL, 'MH 600', NULL, NULL, NULL, 'MH 600', '2021-01-06 12:51:46', 1, 155, 318, 2, NULL, NULL),
(156, NULL, 'MH 685', NULL, NULL, 'Galingas STIHL MH 685 kultivatorius skirtas sunkaus dirvožemio apdirbimui ir yra specialiai sukurtas darbui dideliuose plotuose. Darbinis kultivatoriaus plotis siekia 85 cm. Šis kultivatorius turi vieną priekinę ir vieną atgalinę pavarą. MH 685 projektuojamas su sliekine pavara, centriniu rankenos reguliavimu ir antivibracine sistema. Kultivatorius lengvai išvalomas, pasirinkus technikos valymo padėtį.', 'MH 685', '2021-01-06 12:51:46', 1, 156, 318, 2, NULL, NULL),
(157, NULL, 'MH 700', NULL, NULL, NULL, 'MH 700', '2021-01-06 12:51:46', 1, 157, 318, 2, NULL, NULL),
(158, NULL, 'RT 4082', NULL, NULL, 'STIHL RT 4082 vejos traktorius maloniai nustebins savo komfortiškumu ir puikiu darbu net ir aptvertose vejose iki 4 000 m2. Nedidelis pjovimo plotis užtikrina manevringumą, lengvą ir patogų traktoriaus valdymą soduose, kur gausu medžių ir krūmų. Vieno pedalo pavara, kuria lengvai keičiama važiavimo kryptis, ir reguliuojama vairuotojo sėdynė suteikia daugiau komforto ir užtikrina patogias darbo sąlygas. Kadangi STIHL RT 4082 turi elektromagnetinę pjovimo peilių sankabą, traktoriaus peilius galite lengvai įjungti ir išjungti valdymo skydelyje. Jūsų efektyvų darbą sode užtikrins 80 cm traktoriaus pjovimo plotis, 250 l nupjautos žolės surinkimo dėžė ir patogi žolės surinkimo sistema, skirta tolygiam žolės pjovimui per visą plotį (net ir pakraščiuose).', 'RT 4082', '2021-01-06 12:51:46', 1, 158, 318, 2, NULL, NULL),
(159, NULL, 'RT 4097 SX', NULL, NULL, 'Dirbdami su STIHL RT 4097 SX vejos traktoriumi, greitai ir lengvai nupjausite veją iki 6 000 m2. 95 cm pjovimo plotis ir šoninis nupjautos žolės išmetimas užtikrina lengvą ir greitą darbą net ir dideliuose plotuose. Kadangi STIHL RT 4097 SX turi elektromagnetinę pjovimo peilių sankabą, traktoriaus peiliai gali būti lengvai įjungiami ir išjungiami valdymo skydelyje. Vieno pedalo pavara užtikrina lengvesnį ir greitesnį eigos keitimą iš priekinės į atbulinę.', 'RT 4097 SX', '2021-01-06 12:51:46', 1, 159, 318, 2, NULL, NULL),
(160, NULL, 'RT 4112 SZ', NULL, NULL, 'STIHL RT 4112 SZ yra galingiausias 4-tos serijos (T4) vejos traktorius. Galingas dviejų cilindrų variklis ir 110 cm pjovimo plotis užtikrina lengvą darbą vejose iki 8 000 m². Šoninio nupjautos žolės išmetimo funkcija leidžia perdirbti itin didelius žolės kiekius. Šis vejos traktorius turi vieno pedalo važiavimo pavarą, elektromagnetinę peilių sankabą ir lengvai reguliuojamą sėdynę.', 'RT 4112 SZ', '2021-01-06 12:51:46', 1, 160, 318, 2, NULL, NULL),
(161, NULL, 'RT 5097', NULL, NULL, 'STIHL RT 5097 – 95 cm pjovimo pločio vejos traktorius, komplektuojamas su 250 litrų žolės surinkimo dėže, – užtikrina efektyvų darbą iki 6 000 m² žemės plotuose. Traktoriaus valdymas yra paprastas ir patogus – vairuotojo valdymo skydelyje galima reguliuoti žolės pjovimo aukštį, valdyti elektromagnetinę peilių paleidimo sankabą ir svirtimi ištuštinti žolės surinkimo dėžę. Vieno pedalo pavara, kuria lengvai keičiama važiavimo kryptis, ir reguliuojama vairuotojo sėdynė suteikia dar daugiau komforto. STIHL RT 5097 žolės surinkimo sistema užtikrina tolygų žolės pjovimą ir surinkimą per visą mašinos plotį (net ir pakraščiuose).', 'RT 5097', '2021-01-06 12:51:46', 1, 161, 318, 2, NULL, NULL),
(162, NULL, 'RT 5112 Z', NULL, NULL, 'STIHL RT 5112 Z 110 cm pjovimo pločio vejos traktorius su 2 cilindrų varikliu, sinchronine pjovimo įranga ir žolės surinkimo sistema užtikrina tikslų žolės pjovimą ir gali būti naudojamas iki 8 000 m² žemės plotuose. Valdymo skydelyje galima reguliuoti žolės pjovimo aukštį ir elektromagnetinę peilių paleidimo sankabą, o naudojant šalia vairuotojo sėdynės esančią svirtį – lengvai ištuštinti 350 litrų žolės surinkimo dėžę. Didesniam vairavimo malonumui traktorius turi individualiai reguliuojamą vairuotojo sėdynę ir hidrostatinę pavarų dėžę su vieno pedalo pavara, kuri leidžia greitai ir patogiai keisti važiavimo kryptį.', 'RT 5097', '2021-01-06 12:51:47', 1, 162, 318, 2, NULL, NULL),
(163, NULL, 'RT 6112 ZL', NULL, NULL, 'STIHL RT 6112 ZL vejos traktorius sukurtas efektyviam darbui iki 8 000 m² žemės plotuose. 110 cm pjovimo pločio vejos traktorius, turintis dviejų cilindrų variklį, efektyvią sinchroninę pjovimo įrangą ir žolės surinkimo sistemą, puikiai atlieka savo darbą. Sinchronizuoti pjovimo peiliai garantuoja optimalų žolės surinkimą į 350 litrų dėžę, kuri gali būti lengvai ištuštinama šalia vairuotojo sėdynės esančia svirtimi. Vieno pedalo pavara užtikrina lengvą važiavimo eigos keitimą. Tikslesniam STIHL RT 6112 ZL darbui traktoriaus valdymo skydelyje įmontuotas skystųjų kristalų ekranas ir greičio palaikymo sistema.', 'RT 6112 ZL', '2021-01-06 12:51:47', 1, 163, 318, 2, NULL, NULL),
(164, NULL, 'RT 6127 ZL', NULL, NULL, '125 cm pjovimo pločio STIHL RT 6127 ZL vejos traktorius su dviejų cilindrų varikliu, sinchronine pjovimo įranga ir efektyvia žolės surinkimo sistema užtikrina greitą ir ypač tikslų vejos pjovimą iki 10 000 m² žemės plotuose. Net ir prastomis darbo sąlygomis STIHL traktorius išlieka greitas ir manevringas. Sinchroninės pjovimo įrangos peiliai užtikrina aukštą pjovimo kokybę ir optimalų žolės surinkimą į 350 litrų dėžę, kuri gali būti lengvai ištuštinama šalia vairuotojo sėdynės esančia svirtimi. Valdymo skydelyje sumontuotas skystųjų kristalų ekranas ir greičio palaikymo sistema. Skydelyje taip pat gali būti reguliuojama vieno pedalo pavara su praktišku važiavimo eigos perjungimu.', 'RT 6127 ZL', '2021-01-06 12:51:47', 1, 164, 318, 2, NULL, NULL),
(165, NULL, 'BT 131', NULL, NULL, 'Vieno žmogaus valdomas gręžtuvas su „Quickstop“ grąžto stabdžiu. „4-MIX®“ variklis su didesniu degalų baku, vibraciją slopinantis rankenos rėmas, valdymo rankena su stabdymo mygtuku, ilgalaikė oro filtravimo sistema, didelis įrenginio įdėklas.', 'BT 131', '2021-01-06 12:51:47', 1, 165, 318, 2, NULL, NULL),
(166, NULL, 'SR 200', NULL, NULL, 'Lengvas purkštuvas ypač patogus nešti dėl kompaktiškos konstrukcijos ir arti prie kūno esančio svorio centro. Idealus iki 2,5 m aukščio kultūrų purškimui. Viena ranka valdoma daugiafunkcinė rankena ir apsauginis žiedas, apsaugantis nuo išsiliejimo. Serijinėje komplektacijoje su purkštuku, filtravimo ir dvigubo filtravimo sieteliu.', 'SR 200', '2021-01-06 12:51:47', 1, 166, 318, 2, NULL, NULL),
(167, NULL, 'SR 430', NULL, NULL, 'Galingas purkštuvas skirtas dideliems horizontaliems paviršiams. Paprasta užvedimo technologija. Patogūs pečių diržai. Viena ranka valdoma daugiafunkcė rankena. Serijinė komplektacija su kūgiu, filtravimo ir dvigubo filtravimo sieteliu. Taip pat sumontuotas greitas „Du viename“ keitimo mechanizmas, skirtas barstymui ir granulių purškimui. Paprastas ir tikslus barstomos medžiagos dozavimas.', 'SR 430', '2021-01-06 12:51:47', 1, 167, 318, 2, NULL, NULL),
(168, NULL, 'SR 450', NULL, NULL, 'Galingas purkštuvas skirtas dideliems horizontaliems paviršiams. Paprasta užvedimo technologija. Patogūs pečių diržai. Viena ranka valdoma daugiafunkcė rankena. Serijinė komplektacija su kūgiu, filtravimo ir dvigubo filtravimo sieteliu. Taip pat sumontuotas greitas „Du viename“ keitimo mechanizmas, skirtas barstymui ir granulių purškimui. Paprastas ir tikslus barstomos medžiagos dozavimas.', 'SR 450', '2021-01-06 12:51:47', 1, 168, 318, 2, NULL, NULL),
(169, NULL, 'SG 11', NULL, NULL, 'Ergonomiškas, paprastas naudoti rankinis purkštuvas skystų pesticidų purškimui. Sklandžiai veikiantis ir našus siurblys\npatogiam darbui. Serijinėje komplektacijoje su tuščiaviduriu kūginiu purkštuku.', 'SG 11', '2021-01-06 12:51:47', 1, 169, 318, 2, NULL, NULL),
(170, NULL, 'SG 21', NULL, NULL, 'Rankinis purškiklis, ypač patogus naudoti balkone ir sode prie namų. Dėka esančių petnešų patogu nešioti. Serijinis modelis su tuščiaviduriu kūginiu antgaliu.', 'SG 21', '2021-01-06 12:51:47', 1, 170, 318, 2, NULL, NULL),
(171, NULL, 'SG 31', NULL, NULL, 'Rankinis purkštuvas, skirtas privatiems naudotojams. Plati įpylimo\nanga, ergonomiškas uždaromasis vožtuvas ir teleskopinis vamzdis užtikrina patogų naudojimą. Komplekte tuščiaviduris\nkūginis ir plokščias purkštukas.', 'SG 31', '2021-01-06 12:51:47', 1, 171, 318, 2, NULL, NULL),
(172, NULL, 'SG 51', NULL, NULL, 'Ant nugaros nešiojamas purkštuvas mėgėjams ir profesionalams.\nLabai patogu dirbti, nes siurblio svirtis gali būti montuojama\niš kairės ir iš dešinės pusės, reguliuojamas plotis ir ilgis. Tvirta konstrukcija ilgam, netgi profesionaliam naudojimui.', 'SG 51', '2021-01-06 12:51:47', 1, 172, 318, 2, NULL, NULL),
(173, NULL, 'SG 71', NULL, NULL, 'Ant nugaros nešiojamas purškiklis profesionaliam naudojimui. Siurblio svirtis, montuojama dešinėje arba kairėje, ir ilgio reguliavimas užtikrina patogų naudojimą. Aukštos kokybės diržai\nir nugarai pritaikytos petnešos – komfortiškam darbui. Ergonomiškas uždaromasis vožtuvas su manometru.', 'SG 71', '2021-01-06 12:51:47', 1, 173, 318, 2, NULL, NULL),
(174, NULL, 'RE 90', NULL, NULL, 'Lengvos ir kompaktiškos aukšto slėgio plovyklos pasižymi funkcijų įvairove. Aliumininė siurblio galvutė, integruotas ratų rinkinys, valiklio purškimo rinkinys, rotacinis antgalis, reguliuojamas ventiliatoriaus tipo antgalis, leidžiantis reguliuoti slėgį, nuo trinties apsauganti mova ant pistoleto, poilsio padėtis plovyklai išjungti per pertraukėles, 6 m ilgio aukšto slėgio žarna, gabenimo rankena.', 'RE 90', '2021-01-06 12:51:47', 1, 174, 318, 2, NULL, NULL),
(175, NULL, 'RE 100', NULL, NULL, 'Tvirta ir kompaktiška aukšto slėgio plovykla atlieka įvairias funkcijas. Aliumininė siurblio galvutė, bešepetis indukcinis variklis, integruotas ratų rinkinys, valiklio purškimo rinkinys, rotacinis antgalis, reguliuojamas ventiliatoriaus tipo antgalis, leidžiantis reguliuoti slėgį, nuo trinties apsauganti mova ant pistoleto, poilsio padėtis plovyklai išjungti per pertraukėles, 6 m ilgio aukšto slėgio žarna, pervežimo rankena.', 'RE 100', '2021-01-06 12:51:47', 1, 175, 318, 2, NULL, NULL),
(176, NULL, 'RE 110', NULL, NULL, 'Patogi aukšto slėgio plovykla pasižymi papildomomis funkcijomis. Aliumininė siurblio galvutė, bešepetis indukcinis variklis, integruotas ratų rinkinys, valiklio purškimo rinkinys, rotacinis antgalis, reguliuojamas ventiliatoriaus tipo antgalis, leidžiantis reguliuoti slėgį, nuo trinties apsauganti mova ant pistoleto bei įrankio, poilsio padėtis plovyklai išjungti per pertraukėles, 7 m ilgio aukšto slėgio žarna, gabenimo rankena, ypač ilgas purkštuvas su minkšta rankena, padedančia patogiai valdyti įrenginį, aliumininė teleskopinė rankena, šoninis laikymo skyrius, kuriame palikta vietos antgaliui ir maitinimo kabeliui.', 'RE 110', '2021-01-06 12:51:48', 1, 176, 318, 2, NULL, NULL),
(177, NULL, 'RE 120', NULL, NULL, 'Šią galingą, tvirtą STIHL RE 120 plovyklą turėtų rinktis apie kokybę galvojantys privatūs naudotojai, kurie vertina patogumą. Šiuolaikiško dizaino kompaktiška plovykla greitai atlieka valymo darbus aplink namus ir sode. STIHL RE 120 taip pat veiksmingai valo didelius automobilius, terasas ar fasadus.\nĮspūdinga STIHL RE 120 plovykla pasižymi aukščiausios klasės funkcijomis. Plovyklos rinkinį taip pat sudaro šie komponentai: ventiliatoriaus tipo antgalis, leidžiantis reguliuoti slėgį, galingas rotacinis antgalis, aukšto slėgio pistoletas su rotaciniu pulverizatoriumi ir nuo trinties apsaugančia mova, taip pat integruoti ratų bei valiklio purškimo rinkiniai, turintys dozavimo sistemą. Siekiant didesnio patogumo, šiame modelyje įtaisytas ypač ilgas purkštuvas su minkšta rankena, aliumininė teleskopinė bei gabenimo rankenos ir šoninis laikymo skyrius antgaliams bei maitinimo kabeliui. Plovykla pristatoma kartu su ypač tvirta, lanksčia, plienu sutvirtinta aukšto slėgio žarna.', 'RE 120', '2021-01-06 12:51:48', 1, 177, 318, 2, NULL, NULL),
(178, NULL, 'RE 130 PLUS', NULL, NULL, 'Įspūdinga STIHL RE 130 PLUS plovykla pasižymi aukščiausios kokybės funkcijomis. Į plovyklos rinkinį taip pat įtrauktos šios sudedamosios dalys: vėduoklės tipo antgalis, leidžiantis reguliuoti slėgį, galingas rotacinis antgalis, aukšto slėgio pistoletas su rotaciniu pulverizatoriumi ir nuo trinties apsaugančia mova, taip pat integruoti ratų ir valiklio purškimo rinkiniai, turintys dozavimo sistemą. Siekiant didesnio patogumo, šiame modelyje įtaisytas ypač ilgas purkštuvas su minkšta rankena, aliuminine teleskopine ir gabenimo rankenomis, taip pat šoninis laikymo skyrius antgaliams bei maitinimo kabeliui. Be to, plovykla turi žarnos ritę, leidžiančią patogiai laikyti tvirtą, plienu sutvirtintą aukšto slėgio žarną.', 'RE 130 PLUS', '2021-01-06 12:51:48', 1, 178, 318, 2, NULL, NULL),
(179, NULL, 'RE 150 PLUS', NULL, NULL, NULL, 'RE 150 PLUS', '2021-01-06 12:51:48', 1, 179, 318, 2, NULL, NULL),
(180, NULL, 'RE 170 PLUS', NULL, NULL, NULL, 'RE 170 PLUS', '2021-01-06 12:51:48', 1, 180, 318, 2, NULL, NULL),
(181, NULL, 'RE 232', NULL, NULL, 'Puikus valymo įrenginio modelis pradedantiesiems profesionalams. 10 m armuotos plienu aukšto slėgio žarnos, išorinis ploviklių įsiurbimas ir dozavimas, maitinimo laido fiksatorius, praktiškas purkštuvo laikiklis.', 'RE 232', '2021-01-06 12:51:48', 1, 181, 318, 2, NULL, NULL),
(182, NULL, 'RE 282 PLUS', NULL, NULL, '„PLUS“ patogus ir našus valymo įrenginys. Mažos spartos variklis, žarnos būgnas su 15 m armuotos plienu aukšto slėgio žarnos, antras purkštuvo vamzdis su rotaciniu antgaliu, 400 V maitinimas, atsparūs dilimui, dengti keramika stūmokliai, ergonominis STIHL profesionalus purškiklis, valiklių talpa, slėgio / kiekio reguliatorius, manometras, didelis vandens filtras.', 'RE 282 PLUS', '2021-01-06 12:51:48', 1, 182, 318, 2, NULL, NULL),
(183, NULL, 'RE 362 PLUS', NULL, NULL, 'Žalvarinė siurblio galvutė. Keraminiai stūmokliai. Slėgio/srauto valdymas. Manometras. Valymo priemonių dozavimo sistema ir 2 x 2.5 l valymo priemonių bakai, perjungiami vienu mygtuko paspaudimu. Maitinimo kabelio laikiklis. Sulankstoma stūmimo rankena. Profesionalus STIHL purkštuvas. 15 m plienu armuota žarna.', 'RE 362 PLUS', '2021-01-06 12:51:48', 1, 183, 318, 2, NULL, NULL),
(184, NULL, 'RE 462 PLUS', NULL, NULL, 'Žalvarinė siurblio galvutė. Keraminiai stūmokliai. Slėgio/srauto valdymas. Manometras. Variklio išjungimo vėlinimo mygtukas. Avarinis išjungimas. Valymo priemonių dozavimo sistema ir 2 x 2.5 l valymo priemonių bakai, perjungiami vienu mygtuko paspaudimu. Integruota ritė aukšto slėgio žarnai. Papildomas purkštuvo vamzdis su rotaciniu antgaliu. Maitinimo kabelio laikiklis. Sulankstoma stūmimo rankena. Profesionalus STIHL purkštuvas. Sukamas elektros laido laikiklis. 20 m plienu armuota žarna.', 'RE 462 PLUS', '2021-01-06 12:51:48', 1, 184, 318, 2, NULL, NULL),
(185, NULL, 'SE 33', NULL, NULL, NULL, 'SE 33', '2021-01-06 12:51:49', 1, 185, 318, 2, NULL, NULL),
(186, NULL, 'SE 62', NULL, NULL, 'Dulkių, purvo ir skysčių šalinimui viduje ir lauke. Šlapio/sauso valymo galimybės. Pūtimo funkcija perjungus įsiurbimo žarną prie išėjimo jungties. Kelių lygių filtravimo įranga. Valomas filtras. Keičiami antgaliai: grindų, universalus ir siauras.', 'SE 62', '2021-01-06 12:51:49', 1, 186, 318, 2, NULL, NULL),
(187, NULL, 'SE 122', NULL, NULL, 'STIHL SE 122  - galingas universalus siurblys. Su sūkių reguliavimu ir švelniu paleidimu. Kelių pakopų filtravimo įranga. Siurblys gali būti naudojamas sausam arba šlapiam siurbimui. Įrenginys puikiai tinka namų reikmėms, dirbtuvėse, biuruose ir gamyklose. Ratukai turi stabdžius, tad siurblį galėsite užfiksuoti konkrečioje vietoje ir nesirūpinti, kad jis pajudės. Siurblio rankenėlė ir traukimo vamzdis pagaminti iš nerūdijančio plieno.', 'SE 62', '2021-01-06 12:51:49', 1, 187, 318, 2, NULL, NULL),
(188, NULL, 'KG 770', NULL, NULL, 'Dulkių šlavimui dideliuose vidaus ir lauko plotuose. STIHL &quot;MultiClean PLUS&quot; šlavimo sistema, 8 -ios centrinio aukščio reguliatoriaus padėtys, šlavimas be dulkių, šepečių laikymo apatinėje padėtyje laikiklis, ergonominės formos 2-jų padėčių stūmimo rankena, šonuose sumontuoti ratai, nešiojimo rankena, sandėliuojamas vertikalioje padėtyje taupo vietą, 4 -ių metų naudojimo garantija mažai dylantiems nailoniniams šeriams.', 'KG 770', '2021-01-06 12:51:49', 1, 188, 318, 2, NULL, NULL),
(189, NULL, 'KGA 770', NULL, NULL, 'Aukštos kokybės akumuliatorinė šlavimo mašina dideliems plotams iki 2000m². Akumuliatorinė lėkštinių šluotų ir cilindrinių šepečių pavara  neleidžia mašinai savaime judėti, ji juda stūmimo būdu. Lėkštinės šluotos ir cilindriniai šepečiai visada juda optimaliu greičiu.', 'KGA 770', '2021-01-06 12:51:49', 1, 189, 318, 2, NULL, NULL),
(190, NULL, 'GH 370 S', NULL, NULL, 'Smulkinti sode, kur nėra elektros srovės, puikiai tinka benzininis sodo smulkintuvas GH 370 S. Su galingu 4.6 AG OHV lengvai užvedamu varikliu dirbti vienas malonumas. Peilių įranga &quot;Multi Cut 370&quot; ypač galinga, su 2 apverčiamais peiliais ir centrine kūgio formos nukreipimo anga. Peilių diskas įtraukia šakas iki 45 mm diametro. Dėl plačios važiuoklės su dideliais ratais galima patogiai transportuoti. &quot;Set 300&quot; sumontuotas smulkinti: tiesus piltuvas tinka smulkinti minkštas medžiagas dideliais kiekiais.', 'GH 370 S', '2021-01-06 12:51:49', 1, 190, 318, 2, NULL, NULL),
(191, NULL, 'GH 460', NULL, NULL, 'Benzininiai universalūs smulkintuvai GH 460 &quot;praryja“ viską: minkštas medžiagas lygiai taip pat kaip ir šakas iki 60 mm storio. Paprastesnį pripildymą užtikrina dvi atskiros angos, reikalingą jėgą – galingas, ypač tolygiai veikiantis benzininis variklis, kuris garantuoja ir didesnę galią. Variklis „B&amp;S“ 850 PRO RS serija – 4,5 AG OHV.', 'GH 460', '2021-01-06 12:51:49', 1, 191, 318, 2, NULL, NULL),
(192, NULL, 'GHE 140 L', NULL, NULL, 'Kompaktiški, sulankstomi elektriniai smulkintuvai su galingais elektriniais varikliais pavieniams vidutinio storio šakų smulkinimo darbams. Su elektros pajungimu, „dobilo lapo“ formos anga, integruota dėže susmulkintai medžiagai ir tylaus veleno technologija.', 'GH 460', '2021-01-06 12:51:49', 1, 192, 318, 2, NULL, NULL),
(193, NULL, 'GHE 150', NULL, NULL, 'Su galingu varikliu ir specialia peilių sistema elektrinis šakų smulkintuvas STIHL GH 150 apdoroja storesnes šakas ir paverčia jas nedidele drožlių krūvele. Trumpas, įstrižai sumontuotas piltuvas ir patentuota dobilo lapo formos anga garantuoja, kad medžiagos į įrenginį pateks lengvai ir patogiai. Trumpas piltuvas - paprasta pripildyti. &quot;Multi-Cut 150&quot; su apverčiamais peiliais: triukšmą slopinantis peilių diskas daugiasluoksnėje konstrukcijoje su apverčiamais pjovimo peiliais. Elektromechaninė apsauginė užsklanda su didelėmis prisukimo rankenėlėmis - dar daugiau saugumo. Dideli ratai ir plati važiuoklė garantuoja stabilumą ir lengvą perkėlimą į kitą vietą. Dėl galingo variklio optimaliai susmulkinama. Pažangus jungiklis su jutikline klaviatūra.', 'GHE 150', '2021-01-06 12:51:49', 1, 193, 318, 2, NULL, NULL),
(194, NULL, 'GHE 250', NULL, NULL, 'Elektrinis šakų smulkintuvas STIHL GH 250 puikiai susmulkina tokias minkštas medžiagas, kaip nupjautos gėlės arba medžių lapai. Didelis, triukšmą slopinantis, piltuvas garantuoja tylų darbą. Pažangus jungiklis su jutikline klaviatūra. Galingas variklis su kintamosios srovės varikliu. Dideli ratai ir plati važiuoklė garantuoja stabilumą ir lengvą perkėlimą į kitą vietą. Elektromechaninė apsauginė užsklanda su didelėmis prisukimo rankenėlėmis, skirta papildomai saugai užtikrinti. &quot;Multi-Cut 250&quot;: triukšmą slopinantys daugiasluoksnės konstrukcijos peilių diskai su kreipiamais pjovimo ir draskančiais peiliais bei pirminiu smulkintuvu. Savaiminio įtraukimo įranga, negrąžinanti smulkinamos medžiagos.', 'GHE 250', '2021-01-06 12:51:49', 1, 194, 318, 2, NULL, NULL),
(195, NULL, 'GHE 260 S', NULL, NULL, 'Elektrinis šakų smulkintuvas STIHL GH 260 S puikiai susmulkina storas ir vidutines šakas. Didelis, triukšmą slopinantis, pripildymo piltuvas garantuoja tylų darbą. Pažangus jungiklis su jutikline klaviatūra. Galingas trifazis kintamosios srovės variklis su integruotu fazės keitikliu kištuke. Dideli ratai ir plati važiuoklė garantuoja stabilumą ir lengvą perkėlimą į kitą vietą. Elektromechaninė apsauginė užsklanda su didelėmis prisukimo rankenėlėmis, skirta papildomai saugai užtikrinti. Savaiminio įtraukimo įranga, negrąžinanti smulkinamos medžiagos.', 'GHE 250', '2021-01-06 12:51:49', 1, 195, 318, 2, NULL, NULL),
(196, NULL, 'GHE 355', NULL, NULL, 'Per didelį pripildymo piltuvą, esantį optimaliame aukštyje, galingą kombinuotąjį smulkintuvą STIHL GH 355 prikrauti nesudėtinga. Tiek storos šakos, tiek minkštos smulkinamos medžiagos – su patentuota vertimo technologija BRS (atgalinė peilių sukimosi sistema) ir galinga pjovimo sistema viskas bus tinkamai susmulkinta.', 'GHE 355', '2021-01-06 12:51:50', 1, 196, 318, 2, NULL, NULL),
(197, NULL, 'GHE 375', NULL, NULL, 'Per didelį pripildymo piltuvą, esantį optimaliame aukštyje, galingą kombinuotąjį elektrinį šakų smulkintuvą STIHL GH 375 su trifaziu varikliu prikrauti nesudėtinga. Tiek storos šakos, tiek minkštos smulkinamos medžiagos - su patentuota vertimo technologija BRS (atgalinė peilių sukimosi sistema) ir galinga pjovimo sistema viskas bus tinkamai susmulkinta Ilgas, įstrižas pripildymo piltuvas su itin didele viršutine dalimi, kad būtų lengviau prikrauti, ir optimalia apsauga nuo apipurškimo. Aliuminio kamera: saugi ir tvirta. Skirta storoms / kietoms nupjautoms šakelėms apdoroti. Didelė pralaidos galia ir greitas didelių minkštesnės medžiagos kiekių apdorojimas. Stabili stovo konstrukcija ir dideli ratai ir įtaisyta gabenimo rankena.', 'GHE 375', '2021-01-06 12:51:50', 1, 197, 318, 2, NULL, NULL),
(198, NULL, 'GHE 420', NULL, NULL, 'Vienas įrenginys - dvi funkcijos: universaliame elektriniame šakų smulkintuve STIHL GH 420 yra atskiros pildymo angos. Tuo metu, kai didelis, tiesus smulkintuvas &quot;praryja&quot; daug vietos užimančias minkštas medžiagas, atlenkiamas tiekimo piltuvas pasiglemžia šakas ir medingas medžiagas. Ypač didelė viršutinė piltuvo dalis su integruota apsauga nuo apipurškimo. Atskirų įrankių stalčius ir elektros laido laikiklis, įtaisyti tiesiogiai variklio gaubte. Galingas 230 V elektros variklis. Dideli ratai, skirti lengvai pervežti į kitą vietą. Pjovimo sistema su novatoriška dviejų kamerų sistema. Apsauginis jungiklis, įtaisytas tiesiog gaubto varžte (vienas paspaudimas - vienas pasukimas).', 'GHE 420', '2021-01-06 12:51:50', 1, 198, 318, 2, NULL, NULL),
(199, NULL, 'GHE 450', NULL, NULL, 'Vienas įrenginys - dvi funkcijos: universaliame elektriniame šakų smulkintuve STIHL GHE 450 yra atskiros pildymo angos. Tuo metu, kai didelis, tiesus smulkintuvas &quot;praryja&quot; daug vietos užimančias minkštas medžiagas, atlenkiamas tiekimo piltuvas pasiglemžia šakas ir medingas medžiagas. Ypač didelė viršutinė piltuvo dalis su integruota apsauga nuo apipurškimo. Atskirų įrankių stalčius ir elektros laido laikiklis, įtaisyti tiesiogiai variklio gaubte. Galingas 400 V trifazis elektros variklis. Dideli ratai, skirti lengvai pervežti į kitą vietą. Pjovimo sistema &quot;Multi-Cut 450&quot; su novatoriška dviejų kamerų sistema. Apsauginis jungiklis, įtaisytas tiesiog gaubto varžte (vienas paspaudimas - vienas pasukimas).', 'GHE 450', '2021-01-06 12:51:50', 1, 199, 318, 2, NULL, NULL),
(200, NULL, 'BG 56', NULL, NULL, 'Greitai nupučia lapus ar nupjautą žolę. Apvalus antgalis. 2-MIX variklis, stabdymo mygtukas.', 'BG 56', '2021-01-06 12:51:50', 1, 200, 318, 2, NULL, NULL),
(201, NULL, 'BG 86', NULL, NULL, 'Lapų ir žolės valymui nuo didelių plotų. Dėka HD2-filtro naudoti galima ir labai nešvarioje aplinkoje, kur yra daug dulkių.  Apvalus antgalis, plokščias antgalis, STIHL antivibracinė sistema, STIHL ElastoStart, 2-MIX-variklis, perjungiamas akseliaratorius su stop mygtuku.', 'BG 86', '2021-01-06 12:51:50', 1, 201, 318, 2, NULL, NULL),
(202, NULL, 'BR 200', NULL, NULL, 'Eikite į savo sodą su profesionalia galia naudodami pūtiklį BR 200. Šis nugarinis pūtiklis patenkins visas valymo užduotis. Supaprastinta užvedimo sistema, ergonomiškas dizainas ir antivibracinė sistema užtikrina komfortišką darbą ir nenuvargina. Įrenginys turi 2-MIX variklį išskiriantį mažesnį kenksmingų medžiagų kiekį į aplinką.', 'BR 200', '2021-01-06 12:51:50', 1, 202, 318, 2, NULL, NULL),
(203, NULL, 'BR 430', NULL, NULL, 'Galingas, taupus ir lengvai prižiūrimas pūtiklis su veiksminga antivibracine sistema. Patogiai pašalinsite žolės ir gyvatvorių likučius, lapus arba šiukšles nuo didelių plotų. Nešiojimo ant nugaros sistema su itin plačiais pečių diržais ir didelio ploto paminkštinta nugaros dalimi.', 'BR 430', '2021-01-06 12:51:50', 1, 203, 318, 2, NULL, NULL),
(204, NULL, 'BR 550', NULL, NULL, 'Šis pūtiklis yra skirtas visiems, kurie ieško puikios galios, ekonomiškumo ir kainos santykio. Tai yra galingas ant nugaros nešamas pūtiklis, su reguliuojamo ilgio pūtimo vamzdžiu. Ant nugaros nešamas pūtiklis STIHL BR 550 pasižymi labai ekonomišku ir aplinkai draugišku varikliu. Mažesnės kuro sąnaudos, tačiau galingas variklis ir sumažintas išmetamųjų dujų kiekis yra tai, ko ieško tiek mėgėjas, tiek ir profesionalas. Pūtiklį galima reguliuoti trimis pozicijomis, o tai reiškia, kad jausite tik STIHL užtikrinamą komfortą dirbdami ir visai nesvarbu, ar tvarkysitės savo kieme, ar atliksite darbdavio pavestas užduotis. Tai yra profesionalus įrankis, be kurio neįsivaizduoja savo gyvenimo nė vienas aukštus reikalavimus keliantis komunalinių paslaugų srities ekspertas. Kaip ir kiti STIHL įrankiai šis pūtiklis turi įdiegtą vibracijos mažinimo ir lengvo užvedimo funkciją, tad tikrai negaišite laiko bereikalingoms operacijoms, o svarbiausia darbuositės ilgai ir be nuovargio.', 'BR 550', '2021-01-06 12:51:50', 1, 204, 318, 2, NULL, NULL),
(205, NULL, 'BR 600', NULL, NULL, 'Geriausias, ypač galingas ant nugaros nešiojamas pūtiklis. Labai aukštas oro pralaidumas įvairiausioms valymo užduotims. Puikus galios ir svorio santykis. Puiki anti-vibracijos sistema ir ergonomiškas nešimo rėmas. Inovatyvus 4-MIX ® variklis malonesniam garsui, mažos degalų sąnaudos ir mažos teršalų emisijos.', 'BR 600', '2021-01-06 12:51:50', 1, 205, 318, 2, NULL, NULL),
(206, NULL, 'BR 700', NULL, NULL, 'Ypač aukštos kokybės profesionalus pūstuvas su reguliuojamu pūtimo vamzdžiu ir valdymo rankenos padėties reguliavimu be įrankių. Didelė pūtimo jėga, mažas svoris. Idealiai tinka norint lengvai pašalinti žolę, lapus ir šiukšles iš didelių plotų. Gumuotas dviejų komponentų rankena, „STIHL“ antivibracinė sistema, plačios pečių juostos, klubo diržas, 4-MIX variklis, lengvas užkūrimas, kintamo greičio ir fiksuojama gazo svirtis su stabdymo mygtuku, patogios nešimo rankenos.', 'BR 700', '2021-01-06 12:51:50', 1, 206, 318, 2, NULL, NULL),
(207, NULL, 'BR 800 C-E', NULL, NULL, 'STIHL galingiausias nupūtėjas: praktiškas šoninis užvedimas - patogiai užveskite įrenginį iš naujo, nenusiimdami nuo nugaros. Rankenos padėties reguliavimas be įrankių ir lengvas pūtimo vamzdžio reguliavimas. Minkšta rankena, STIHL antivibracinė sistema, ergonomiškos formos, platūs nešiojimo diržai, klubo diržas, krūtinės diržas, 4-MIX variklis, paprastas užvedimas, pūtimo greičio reguliavimas su gesinimo mygtuku, nešiojimas rankena.', 'BR 800 C-E', '2021-01-06 12:51:50', 1, 207, 318, 2, NULL, NULL),
(208, NULL, 'BGA 45', NULL, NULL, 'Rankinis akumuliatorinis pūtiklis, skirtas valyti mažesnius plotus šalia namų. Apvalus antgalis, įmontuotas akumuliatorius, sieninis laikiklis su įkrovimo funkcija, praktiškam sandėliavimui ir įrenginio įkrovai tuo pat metu, svoris 2,0 kg. Akumuliatoriaus įkrovimo laikas 210 min /300 min (80 % /100 %).', 'BGA 45', '2021-01-06 12:51:51', 1, 208, 318, 2, NULL, NULL),
(209, NULL, 'BGA 57', NULL, NULL, 'Puikiai subalansuotas akumuliatorinis pūtiklis, kuris suteikia malonų ir nevarginantį darbą. Apvalus antgalis, minkšta rankena su „Ergo“ svirtimi, trijų pakopų reguliuojamo ilgio pūtimo vamzdis skirtas optimaliam pūtimo jėgos panaudojimui.', 'BGA 57', '2021-01-06 12:51:51', 1, 209, 318, 2, NULL, NULL),
(210, NULL, 'BGA 86', NULL, NULL, 'Patogiai valdomas, labai galingas akumuliatorinis pūtiklis, skirtas profesionaliam naudojimui, ypač miesto erdvėse tokiose, kaip žaidimų ir automobilių stovėjimo aikštelės. Pašalinti lapus, žaliąsias atliekas ir nešvarumus. 40 % daugiau pūtimo galios, lyginant su BGA 85, tuo pat metu mažesnio svorio. Apvalus antgalis, minkšta rankena, trijų pakopų, reguliuojamo ilgio pūtimo vamzdis. Kaip priedą galima įsigyti plokščią antgalį, skirtą padidinti oro greitį.', 'BGA 86', '2021-01-06 12:51:51', 1, 210, 318, 2, NULL, NULL),
(211, NULL, 'BGA 100', NULL, NULL, 'Maloniai tylus, lengvas ir labai našus akumuliatorinis pūtiklis, skirtas profesionaliam naudojimui. Ypač tinka naudoti mieste, jautriose triukšmui vietose. Apvalus antgalis, paminkštinta rankena, trys galios režimai su papildoma didinimo funkcija, trimis\npadėtimis reguliuojamas pūtimo vamzdžio ilgis, kilpos, skirtos įrenginio įdėklui pritvirtinti, svoris 2,5 kg. Ilgesniam nepertraukiamam darbui rekomenduojamas ant nugaros nešiojamas akumuliatorius AR 3000 su paminkštinimu ir &quot;komfort&quot; kabliu, trumpesnį laiką atliekamiems darbams skirtas akumuliatorius.', 'BGA 100', '2021-01-06 12:51:51', 1, 211, 318, 2, NULL, NULL),
(212, NULL, 'BGA 200', NULL, NULL, 'Galingiausias STIHL akumuliatorinis pūtiklis BGA 200, kuris ne tik suteikia beveik 25% didesnę pūtimo jėgą nei BGA 100, bet ir idealiai tinka, kur nepageidaujamas didelis triukšmas. Pūtiklis pasižymi ergonomišku dizainu. Tylus veikimas leidžia namų savininkams ir aplinką prižiūrintiems specialistams dirbti garsui jautriose vietose. Trys galios lygiai su kintamu greičiu, bei &quot;boost&quot; režimas padeda nupūsti visas šiūkšles nuo valomų paviršių. Pastovaus greičio palaikymo sistema leidžia  palaikyti pūtimo jėgą, nelaikant pastoviai nuspaudus jungtuko. Reguliuojamas pūstuvo vamzdis su metaliniu žiedu suteikia ne tik geresnes eksploatacines savybes, bet ir suteikia galimybę vieno mygtuko paspaudimu prisitaikyti pūtimo vamzdžio ilgį. Metalinis žiedas pūtimo vamzdžio gale, suteikia patvarumą ir apsaugą nuo nusidėvėjimo. Komplektuojamas su nešiojimo sistema.', 'BGA 200', '2021-01-06 12:51:51', 1, 212, 318, 2, NULL, NULL),
(213, NULL, 'BGE 71', NULL, NULL, 'Lengvai naudojamas ir tylus elektrinis STIHL BGE 71 pūtimo įtaisas gali būti naudojamas norint sutvarkyti sodus, šaligatvius ir daugybę kitų sričių. Labai efektyvus triukšmo mažinimas su galingu pūtiklio pajėgumu. Suderinus su praktišku  vakuuminiu adapterio rinkiniu, pūtimo įtaisas gali būti paverstas siurbimo įrenginiu su surinkimo krepšiu didelių atliekų kiekių suspaudimui.', 'BGE 71', '2021-01-06 12:51:51', 1, 213, 318, 2, NULL, NULL),
(214, NULL, 'SH 56', NULL, NULL, 'Serijinis modelis: galima naudoti ir kaip pūstuvą. Greičio kontrolė, apvalus antgalis, 2-MIX-variklis.', 'SH 56', '2021-01-06 12:51:51', 1, 214, 318, 2, NULL, NULL),
(215, NULL, 'SH 86', NULL, NULL, 'Labai stipriai siurbia. Idealus dideliems plotams valyti. Serijinėje komplektacijoje gali būti naudojamas ir kaip pūtiklis. Su patogia STIHL antivibracine sistema, pūtimo vamzdžiu, apvaliu ir plokščiu antgaliu. Dėl naujojo HD2 oro filtro tinkamas naudoti ir labai dulkėtoje aplinkoje.', 'SH 86', '2021-01-06 12:51:51', 1, 215, 318, 2, NULL, NULL),
(216, NULL, 'GTA 26', NULL, NULL, 'Universalus akumuliatorinis genėtuvas. Skirtas medžiams ir krūmams genėti, žaliosioms atliekoms pjauti ar statybos darbams iš medžio. Su 1/4 colio „PM3“ pjovimo grandine, skirta našiam ir galingam pjovimui. Ergonomiška, neslidi valdymo rankena. Grandinės keitimas be įrankių, lankstus apsauginis gaubtas saugiam darbui, su įkrovos būsenos indikatoriumi.\n&lt;p&gt;Rinkinyje: &lt;/p&gt;\n&lt;br&gt; 1 x ličio jonų akumuliatorius AS 2, 28 Wh, 10,8 V&lt;/br&gt; \n&lt;br&gt; 1 x standartinis įkroviklis AL 1&lt;/br&gt; \n&lt;br&gt; 1 x „Light“ pjovimo juosta, 10 cm&lt;/br&gt; \n&lt;br&gt; 1 x 1/4 colio „PM3“ pjovimo grandinė, 10 cm&lt;/br&gt; \n&lt;br&gt; 1 x „Multioil Bio“, 50 ml&lt;/br&gt; \n&lt;br&gt; 1 x gabenimo krepšys, juodas / oranžinis, su ąsomis tvirtinti prie sienos&lt;/br&gt;', 'SHE 81', '2021-01-06 12:51:51', 1, 216, 318, 2, NULL, NULL);
